INSERT INTO `Movies` VALUES (1,18,'The Fifth Element','In 2257, a taxi driver is unintentionally given the task of saving a young girl who is part of the key that will ensure the survival of humanity.',1,126,'Adventure',1997,7.5,'https://image.tmdb.org/t/p/w500/fPtlCO1yQtnoLHOwKtWz7db6RGU.jpg'),(2,67693,'Jocks','The coach of a college tennis team is given an ultimatum: put together a winning team, or else.',5,91,'Comedy',1986,5.4,'https://image.tmdb.org/t/p/w500/tgjpxqrugdbnADyKGvo65kySaBL.jpg'),(3,177572,'Big Hero 6','The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.',9,102,'Adventure',2014,7.8,'https://image.tmdb.org/t/p/w500/xozrGME58olN1xBhtxmjpOoY0jH.jpg'),(4,660295,'The Platform Master','Three filmmakers set out across the country to meet Internet celebrity and video game savant Ulillillia. When they arrived, his hometown was hit by the worst flood in it\'s history. The resulting film is an insightful look into the extraordinary life of a uniquely brilliant video game designer, and a guided tour of his small Mid-Western hometown in the aftermath of the disaster.',13,101,'Unknown',2019,10,'https://image.tmdb.org/t/p/w500/vtQ8BS9htQ5TEVk3WDvnJFPOQdo.jpg'),(5,577922,'Tenet','Armed with only one word - Tenet - and fighting for the survival of the entire world, the Protagonist journeys through a twilight world of international espionage on a mission that will unfold in something beyond real time.',15,0,'Action',2020,0,'https://image.tmdb.org/t/p/w500/k68nPLbIST6NP96JmTxmZijEvCA.jpg'),(6,582596,'The Wrong Missy','A guy meets the woman of his dreams and invites her to his company\'s corporate retreat, but realizes he sent the invite to the wrong person.',19,89,'Comedy',2020,6.2,'https://image.tmdb.org/t/p/w500/A2YlIrzypvhS3vTFMcDkG3xLvac.jpg'),(7,502425,'Escape From Pretoria','South Africa, 1978. Tim Jenkin and Stephen Lee, two white political activists from the African National Congress imprisoned by the apartheid regime, put a plan in motion to escape from the infamous Pretoria Prison…',23,102,'Drama',2020,6.5,'https://image.tmdb.org/t/p/w500/8GGS0jkFFCnmdStvZED6NL6V7gd.jpg'),(8,556678,'Emma.','In 1800s England, a well-meaning but selfish young woman meddles in the love lives of her friends.',27,124,'Comedy',2020,7,'https://image.tmdb.org/t/p/w500/sm8iVzA7kRp0d4BSIsgXjsSBMKV.jpg'),(9,429617,'Spider-Man: Far from Home','Peter Parker and his friends go on a summer trip to Europe. However, they will hardly be able to rest - Peter will have to agree to help Nick Fury uncover the mystery of creatures that cause natural disasters and destruction throughout the continent.',31,129,'Action',2019,7.5,'https://image.tmdb.org/t/p/w500/4q2NNj4S5dG2RLF9CpXsej7yXl.jpg'),(10,602147,'Inheritance','A patriarch of a wealthy and powerful family suddenly passes away, leaving his wife and daughter with a shocking secret inheritance that threatens to unravel and destroy their lives.',35,110,'Thriller',2020,5.8,'https://image.tmdb.org/t/p/w500/l13mt3oHErSkkqJbN1bjzgtK0Vq.jpg'),(11,674,'Harry Potter and the Goblet of Fire','Harry starts his fourth year at Hogwarts, competes in the treacherous Triwizard Tournament and faces the evil Lord Voldemort. Ron and Hermione help Harry manage the pressure – but Voldemort lurks, awaiting his chance to destroy Harry and all that he stands for.',39,157,'Adventure',2005,7.8,'https://image.tmdb.org/t/p/w500/fECBtHlr0RB3foNHDiCBXeg9Bv9.jpg'),(12,283995,'Guardians of the Galaxy Vol. 2','The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill\'s true parentage.',42,137,'Action',2017,7.6,'https://image.tmdb.org/t/p/w500/y4MBh0EjBlMuOzv9axM4qJlmhzz.jpg'),(13,150540,'Inside Out','Growing up can be a bumpy road, and it\'s no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Riley\'s guiding emotions— Joy, Fear, Anger, Disgust and Sadness—live in Headquarters, the control centre inside Riley\'s mind, where they help advise her through everyday life and tries to keep things positive, but the emotions conflict on how best to navigate a new city, house and school.',46,95,'Drama',2015,7.9,'https://image.tmdb.org/t/p/w500/2H1TmgdfNtsKlU9jKdeNyYL5y8T.jpg'),(14,425,'Ice Age','With the impending ice age almost upon them, a mismatched trio of prehistoric critters – Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth – find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends but, when enemies attack, their quest takes on far nobler aims.',50,81,'Animation',2002,7.3,'https://image.tmdb.org/t/p/w500/gLhHHZUzeseRXShoDyC4VqLgsNv.jpg'),(15,346914,'Happy Hour','The middle-aged family man Hans-Christian (HC) left by his wife goes to Ireland for a short break with his old friends Wolfgang and Nic. He should win at Guinness bonfires and fishing trips distance to the chaos at home. HC has to learn to say no and need other women, his friends believe, to get rid of his loser habitus. In the already tense situation, old competition fights, outbursts of anger and self-pity quickly come up. And Nic and Wolfgang seem to have needed the time-out almost as much as HC.',54,95,'Drama',2015,6.5,'https://image.tmdb.org/t/p/w500/jUtTcSKzKe9mDu3dP3UrsVY5vtE.jpg'),(16,210577,'Gone Girl','With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.',58,149,'Mystery',2014,7.9,'https://image.tmdb.org/t/p/w500/tQf4DUygWo64AOuqgk4jEDCE3Ws.jpg'),(17,27205,'Inception','Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.',15,148,'Action',2010,8.3,'https://image.tmdb.org/t/p/w500/9gk7adHYeDvHkCSEqAvQNLV5Uge.jpg'),(18,767,'Harry Potter and the Half-Blood Prince','As Harry begins his sixth year at Hogwarts, he discovers an old book marked as \'Property of the Half-Blood Prince\', and begins to learn more about Lord Voldemort\'s dark past.',65,153,'Adventure',2009,7.7,'https://image.tmdb.org/t/p/w500/Ag21otqbeynZPGjEbzyr3X5Us0j.jpg'),(19,87101,'Terminator Genisys','The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John\'s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.',66,126,'Science Fiction',2015,5.9,'https://image.tmdb.org/t/p/w500/oZRVDpNtmHk8M1VYy1aeOWUXgbC.jpg'),(20,102651,'Maleficent','A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land.  Maleficent rises to be the land\'s fiercest protector, but she ultimately suffers a ruthless betrayal – an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading King\'s successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom – and to Maleficent\'s true happiness as well.',70,97,'Fantasy',2014,7.1,'https://image.tmdb.org/t/p/w500/ik8PugpL41s137RAWEGTAWu0dPo.jpg'),(21,501395,'True History of the Kelly Gang','Set against the badlands of colonial Australia where the English rule with a bloody fist and the Irish endure, Ned Kelly discovers he comes from a line of Irish rebels—an uncompromising army of cross dressing bandits immortalised for terrorising their oppressors back in Ireland. Nurtured by the notorious bushranger, Harry Power and fuelled by the unfair arrest of his mother, Kelly recruits a wild bunch of warriors to plot one of the most audacious attacks of anarchy and rebellion the country has ever seen.',74,124,'Drama',2020,6.2,'https://image.tmdb.org/t/p/w500/uZF4BZe45icLx7XVFUFnmLEemNm.jpg'),(22,293660,'Deadpool','Deadpool tells the origin story of former Special Forces operative turned mercenary Wade Wilson, who after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.',78,108,'Action',2016,7.6,'https://image.tmdb.org/t/p/w500/yGSxMiF0cYuAiyuve5DA6bnWEOI.jpg'),(23,286217,'The Martian','During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.',82,141,'Drama',2015,7.7,'https://image.tmdb.org/t/p/w500/5BHuvQ6p9kfc091Z8RiFNhCwL4b.jpg'),(24,197,'Braveheart','Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.',86,178,'Action',1995,7.9,'https://image.tmdb.org/t/p/w500/or1gBugydmjToAEq7OZY0owwFk.jpg'),(25,338762,'Bloodshot','After he and his wife are murdered, marine Ray Garrison is resurrected by a team of scientists. Enhanced with nanotechnology, he becomes a superhuman, biotech killing machine—\'Bloodshot\'. As Ray first trains with fellow super-soldiers, he cannot recall anything from his former life. But when his memories flood back and he remembers the man that killed both him and his wife, he breaks out of the facility to get revenge, only to discover that there\'s more to the conspiracy than he thought.',89,110,'Action',2020,7.1,'https://image.tmdb.org/t/p/w500/8WUVHemHFH2ZIP6NWkwlHWsyrEL.jpg'),(26,603,'The Matrix','Set in the 22nd century, The Matrix tells the story of a computer hacker who joins a group of underground insurgents fighting the vast and powerful computers who now rule the earth.',93,136,'Action',1999,8.1,'https://image.tmdb.org/t/p/w500/f89U3ADr1oiB1s9GkdPOEpXUk5H.jpg'),(27,597295,'Love The Way You Are','Opposites clash when spunky girl next door Lin Lin meets eccentric nerd Yuke. Despite being neighbors and schoolmates since childhood, Lin Lin and Yuke barely know each other. When the pair are both admitted into the same university, Lin Lin discovers that Yuke harbors a secret crush for campus beauty, Ruting. Ever the busybody, Lin Lin decides to matchmake Yuke and Ruting, only to find herself gradually falling for Yuke.',97,0,'Romance',2019,4.9,'https://image.tmdb.org/t/p/w500/7BC2Mv2ekyBIto68YOrc1DRARv6.jpg'),(28,592834,'My Spy','A hardened CIA operative finds himself at the mercy of a precocious 9-year-old girl, having been sent undercover to surveil her family.',101,102,'Family',2020,7.1,'https://image.tmdb.org/t/p/w500/n2C6jRK9PtPIs99RQhKtqGlsnsO.jpg'),(29,508439,'Onward','In a suburban fantasy world, two teenage elf brothers embark on an extraordinary quest to discover if there is still a little magic left out there.',104,102,'Animation',2020,7.9,'https://image.tmdb.org/t/p/w500/f4aul3FyD3jv3v4bul1IrkWZvzq.jpg'),(30,552178,'Dark Waters','A tenacious attorney uncovers a dark secret that connects a growing number of unexplained deaths to one of the world\'s largest corporations. In the process, he risks everything — his future, his family, and his own life — to expose the truth.',106,127,'Drama',2019,7.4,'https://image.tmdb.org/t/p/w500/hJ6YEbrjFvToa5c7IiUqILoB6Je.jpg'),(31,157336,'Interstellar','Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.',15,169,'Adventure',2014,8.3,'https://image.tmdb.org/t/p/w500/gEU2QniE6E77NI6lCU6MxlNBvIx.jpg'),(32,420818,'The Lion King','Simba idolizes his father, King Mufasa, and takes to heart his own royal destiny. But not everyone in the kingdom celebrates the new cub\'s arrival. Scar, Mufasa\'s brother—and former heir to the throne—has plans of his own. The battle for Pride Rock is ravaged with betrayal, tragedy and drama, ultimately resulting in Simba\'s exile. With help from a curious pair of newfound friends, Simba will have to figure out how to grow up and take back what is rightfully his.',111,118,'Adventure',2019,7.2,'https://image.tmdb.org/t/p/w500/2bXbqYdUdNVa8VIWXVfclP2ICtT.jpg'),(33,624808,'Love Wedding Repeat','While trying to make his sister\'s wedding day go smoothly, Jack finds himself juggling an angry ex-girlfriend, an uninvited guest with a secret, a misplaced sleep sedative, and the girl that got away in alternate versions of the same day.',115,100,'Comedy',2020,5.8,'https://image.tmdb.org/t/p/w500/zn7feouGPU8sELez4qvpp0EtgeQ.jpg'),(34,458305,'Vivarium','A young woman and her fiancé are in search of the perfect starter home. After following a mysterious real estate agent to a new housing development, the couple finds themselves trapped in a maze of identical houses and forced to raise an otherworldly child.',119,97,'Thriller',2019,5.7,'https://image.tmdb.org/t/p/w500/myf3qzpeN0JbuFRPwSpJcz7rmAT.jpg'),(35,550,'Fight Club','A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.',58,139,'Drama',1999,8.4,'https://image.tmdb.org/t/p/w500/bptfVGEQuv6vDTIMVCHjJ9Dz8PX.jpg'),(36,330457,'Frozen II','Elsa, Anna, Kristoff and Olaf head far into the forest to learn the truth about an ancient mystery of their kingdom.',126,104,'Animation',2019,7.2,'https://image.tmdb.org/t/p/w500/pjeMs3yqRmFL3giJy4PMXWZTTPa.jpg'),(37,335984,'Blade Runner 2049','Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what\'s left of society into chaos. K\'s discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.',130,163,'Science Fiction',2017,7.4,'https://image.tmdb.org/t/p/w500/gajva2L0rPYkEWjzgFlBXCAVBE5.jpg'),(38,503919,'The Lighthouse','Two lighthouse keepers try to maintain their sanity while living on a remote and mysterious New England island in the 1890s.',134,109,'Drama',2019,7.6,'https://image.tmdb.org/t/p/w500/3nk9UoepYmv1G9oP18q6JJCeYwN.jpg'),(39,398818,'Call Me by Your Name','In 1980s Italy, a relationship begins between seventeen-year-old teenage Elio and the older adult man hired as his father\'s research assistant.',137,132,'Romance',2017,8.3,'https://image.tmdb.org/t/p/w500/tcNniniS4rfqrLH0oORikJfnIwY.jpg'),(40,884,'Crash','After getting into a serious car accident, a TV director discovers an underground sub-culture of scarred, omnisexual car-crash victims who use car accidents and the raw sexual energy they produce to try to rejuvenate his sex life with his wife.',141,90,'Drama',1996,6.5,'https://image.tmdb.org/t/p/w500/prJlxxMZ4bbvefnDU4H6dSL3Fub.jpg'),(41,238,'The Godfather','Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.',145,175,'Drama',1972,8.7,'https://image.tmdb.org/t/p/w500/iVZ3JAcAjmguGPnRNfWFOtLHOuY.jpg'),(42,348,'Alien','During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.',82,117,'Horror',1979,8.1,'https://image.tmdb.org/t/p/w500/vfrQk5IPloGg1v9Rzbh2Eg3VGyM.jpg'),(43,920,'Cars','Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.',152,117,'Animation',2006,6.8,'https://image.tmdb.org/t/p/w500/qa6HCwP4Z15l3hpsASz3auugEW6.jpg'),(44,8392,'My Neighbor Totoro','Two sisters move to the country with their father in order to be closer to their hospitalized mother, and discover the surrounding trees are inhabited by Totoros, magical spirits of the forest. When the youngest runs away from home, the older sister seeks help from the spirits to find her.',156,86,'Fantasy',1988,8.1,'https://image.tmdb.org/t/p/w500/g6CsQ3xmalyrGzTSqmkZbNbHK3L.jpg'),(45,19995,'Avatar','In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.',160,162,'Action',2009,7.4,'https://image.tmdb.org/t/p/w500/btnl50ZDJDSCal2NLQIYWw0XxvH.jpg'),(46,198184,'Chappie','Every child comes into the world full of promise, and none more so than Chappie: he is gifted, special, a prodigy. Like any child, Chappie will come under the influence of his surroundings—some good, some bad—and he will rely on his heart and soul to find his way in the world and become his own man. But there\'s one thing that makes Chappie different from any one else: he is a robot.',163,120,'Crime',2015,6.7,'https://image.tmdb.org/t/p/w500/18IydtBgq8aJZpbP6NxCAGjHhae.jpg'),(47,567608,'Last Moment of Clarity','A normal New Yorker\'s life is upended when his girlfriend is murdered by the Bulgarian mob. He flees to Paris to hide from her killers. But three years later, he sees a similar looking woman on the silver screen. Obsession with past love takes Sam to Los Angeles to look for answers, only to put him back into the sights of the Bulgarians.',166,90,'Thriller',2020,5.5,'https://image.tmdb.org/t/p/w500/kYHLJIu23bo0MWgUm7KMa1zNa5l.jpg'),(48,429422,'Capone','The 47-year old Al Capone, after 10 years in prison, starts suffering from dementia and comes to be haunted by his violent past.',170,103,'Crime',2020,5.2,'https://image.tmdb.org/t/p/w500/75gDv38UgRtAukSxNXcjatyQmEa.jpg'),(49,9823,'Mortal Kombat: Annihilation','A group of heroic warriors has only six days to save the planet in \"Mortal Kombat Annihilation.\" To succeed they must survive the most spectacular series of challenges any human, or god, has ever encountered as they battle an evil warlord bent on taking control of Earth. Sequel to the film \"Mortal Kombat,\" and based on the popular video game.',174,95,'Action',1997,4.1,'https://image.tmdb.org/t/p/w500/ttryglcY2osWZE3sRYBf3ewTZsW.jpg'),(50,359724,'Ford v Ferrari','American car designer Carroll Shelby and the British-born driver Ken Miles work together to battle corporate interference, the laws of physics, and their own personal demons to build a revolutionary race car for Ford Motor Company and take on the dominating race cars of Enzo Ferrari at the 24 Hours of Le Mans in France in 1966.',178,152,'Drama',2019,7.9,'https://image.tmdb.org/t/p/w500/6ApDtO7xaWAfPqfi2IARXIzj8QS.jpg'),(51,565310,'The Farewell','A headstrong Chinese-American woman returns to China when her beloved grandmother is given a terminal diagnosis. Billi struggles with her family\'s decision to keep grandma in the dark about her own illness as they all stage an impromptu wedding to see grandma one last time.',181,100,'Comedy',2019,7.6,'https://image.tmdb.org/t/p/w500/7ht2IMGynDSVQGvAXhAb83DLET8.jpg'),(52,576156,'The Lovebirds','A couple experiences a defining moment in their relationship when they are unintentionally embroiled in a murder mystery. As their journey to clear their names takes them from one extreme – and hilarious - circumstance to the next, they must figure out how they, and their relationship, can survive the night.',185,86,'Action',2020,6.4,'https://image.tmdb.org/t/p/w500/5jdLnvALCpK1NkeQU1z4YvOe2dZ.jpg'),(53,862,'Toy Story','Led by Woody, Andy\'s toys live happily in his room until Andy\'s birthday brings Buzz Lightyear onto the scene. Afraid of losing his place in Andy\'s heart, Woody plots against Buzz. But when circumstances separate Buzz and Woody from their owner, the duo eventually learns to put aside their differences.',152,81,'Animation',1995,7.9,'https://image.tmdb.org/t/p/w500/uXDfjJbdP4ijW5hWSBrPrlKpxab.jpg'),(54,244786,'Whiplash','Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.',192,107,'Drama',2014,8.4,'https://image.tmdb.org/t/p/w500/qq8xf2SQqHifUUyc0k6Hj1065f1.jpg'),(55,269149,'Zootopia','Determined to prove herself, Officer Judy Hopps, the first bunny on Zootopia\'s police force, jumps at the chance to crack her first case - even if it means partnering with scam-artist fox Nick Wilde to solve the mystery.',196,109,'Animation',2016,7.7,'https://image.tmdb.org/t/p/w500/hlK0e0wAQ3VLuJcsfIYPvb4JVud.jpg'),(56,698296,'The Art of \'Spirited Away\'','The people that brought the film Sen to Chihiro no kamikakushi (2001) (a.k.a. \"Spirited Away\") to the US explain how it was converted into English, with some minor confusion between languages, and how well it did in both Japan and America.',200,15,'Documentary',2003,0,'https://image.tmdb.org/t/p/w500/x1iaVnI4mTaETwAKTLyIAKFwQSJ.jpg'),(57,854,'The Mask','When timid bank clerk Stanley Ipkiss discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle. Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell, whose goons get blamed for the heist.',204,101,'Romance',1994,6.9,'https://image.tmdb.org/t/p/w500/yd3wjLLeQHJ3oRDy4wwiNNFVyLW.jpg'),(58,71186,'The Rifleman of the Voroshilov Regiment','A very typical post-Soviet era storyline. A bunch of vagabonds lured an innocent teenage girl to their apartment, offered her a drink, intimidated, then gang raped her. Local cops are incapable to undertake an adequate actions against the scoundrels - prevented by the superior chief of the local police, who is the dad of one of the scumbags. The case is closed. The girl\'s granddad tired of an endless circumlocution decides to take revenge in his own hands.',208,95,'Drama',1999,7.2,'https://image.tmdb.org/t/p/w500/ncMZhkjktqLLlN7j0o3PZ3dF4XP.jpg'),(59,1726,'Iron Man','After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.',111,126,'Action',2008,7.6,'https://image.tmdb.org/t/p/w500/78lPtwv72eTNqFW9COBYI0dWDJa.jpg'),(60,597,'Titanic','101-year-old Rose DeWitt Bukater tells the story of her life aboard the Titanic, 84 years later. A young Rose boards the ship with her mother and fiancé. Meanwhile, Jack Dawson and Fabrizio De Rossi win third-class tickets aboard the ship. Rose tells the whole story from Titanic\'s departure through to its death—on its first and last voyage—on April 15, 1912.',160,194,'Drama',1997,7.8,'https://image.tmdb.org/t/p/w500/9xjZS2rlVxm8SFx8kPC3aIGCOYQ.jpg'),(61,218,'The Terminator','In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the \"Terminator\" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?',160,108,'Action',1984,7.6,'https://image.tmdb.org/t/p/w500/qvktm0BHcnmDpul4Hz01GIazWPr.jpg'),(62,96721,'Rush','A biographical drama centered on the rivalry between Formula 1 drivers James Hunt and Niki Lauda during the 1976 Formula One motor-racing season.',219,123,'Drama',2013,7.7,'https://image.tmdb.org/t/p/w500/uWcMgxO3p3qwVFUxsRz1HbTzGvT.jpg'),(63,44833,'Battleship','When mankind beams a radio signal into space, a reply comes from ‘Planet G’, in the form of several alien crafts that splash down in the waters off Hawaii. Lieutenant Alex Hopper is a weapons officer assigned to the USS John Paul Jones, part of an international naval coalition which becomes the world\'s last hope for survival as they engage the hostile alien force of unimaginable strength. While taking on the invaders, Hopper must also try to live up to the potential that his brother, and his fiancée\'s father, Admiral Shane, expect of him.',223,131,'Thriller',2012,5.7,'https://image.tmdb.org/t/p/w500/9b0Im7SfedHiajTwzSL9zGyBI7M.jpg'),(64,329865,'Arrival','Taking place after alien crafts land around the world, an expert linguist is recruited by the military to determine whether they come in peace or are a threat.',130,116,'Drama',2016,7.5,'https://image.tmdb.org/t/p/w500/x2FJsf1ElAgr63Y3PNPtJrcmpoe.jpg'),(65,99861,'Avengers: Age of Ultron','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.',230,141,'Action',2015,7.3,'https://image.tmdb.org/t/p/w500/4ssDuvEDkSArWEdyBl2X5EHvYKU.jpg'),(66,332562,'A Star Is Born','Seasoned musician Jackson Maine discovers — and falls in love with — struggling artist Ally. She has just about given up on her dream to make it big as a singer — until Jack coaxes her into the spotlight. But even as Ally\'s career takes off, the personal side of their relationship is breaking down, as Jack fights an ongoing battle with his own internal demons.',232,136,'Drama',2018,7.5,'https://image.tmdb.org/t/p/w500/wrFpXMNBRj2PBiN4Z5kix51XaIZ.jpg'),(67,530915,'1917','At the height of the First World War, two young British soldiers must cross enemy territory and deliver a message that will stop a deadly attack on hundreds of soldiers.',235,119,'War',2019,7.9,'https://image.tmdb.org/t/p/w500/iZf0KyrE25z1sage4SYFLCCrMi9.jpg'),(68,419704,'Ad Astra','The near future, a time when both hope and hardships drive humanity to look to the stars and beyond. While a mysterious phenomenon menaces to destroy life on planet Earth, astronaut Roy McBride undertakes a mission across the immensity of space and its many perils to uncover the truth about a lost expedition that decades before boldly faced emptiness and silence in search of the unknown.',238,123,'Science Fiction',2019,6,'https://image.tmdb.org/t/p/w500/xBHvZcjRiWyobQ9kxBhO6B2dtRI.jpg'),(2184,22,'Pirates of the Caribbean: The Curse of the Black Pearl','Jack Sparrow, a freewheeling 18th-century pirate, quarrels with a rival pirate bent on pillaging Port Royal. When the governor\'s daughter is kidnapped, Sparrow decides to help the girl\'s love save her.',292,143,'Adventure',2003,7.7,'https://image.tmdb.org/t/p/w500/z8onk7LV9Mmw6zKz4hT6pzzvmvl.jpg'),(2185,284053,'Thor: Ragnarok','Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of an all-powerful new threat, the ruthless Hela.',296,131,'Action',2017,7.6,'https://image.tmdb.org/t/p/w500/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg'),(2186,49051,'The Hobbit: An Unexpected Journey','Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.',299,169,'Adventure',2012,7.3,'https://image.tmdb.org/t/p/w500/yHA9Fc37VmpUA5UncTxxo3rTGVA.jpg'),(2187,512200,'Jumanji: The Next Level','As the gang return to Jumanji to rescue one of their own, they discover that nothing is as they expect. The players will have to brave parts unknown and unexplored in order to escape the world’s most dangerous game.',303,123,'Adventure',2019,6.9,'https://image.tmdb.org/t/p/w500/jyw8VKYEiM1UDzPB7NsisUgBeJ8.jpg'),(2188,131631,'The Hunger Games: Mockingjay - Part 1','Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.',307,123,'Science Fiction',2014,6.8,'https://image.tmdb.org/t/p/w500/4FAA18ZIja70d1Tu5hr5cj2q1sB.jpg'),(2189,280,'Terminator 2: Judgment Day','Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.',160,156,'Action',1991,8,'https://image.tmdb.org/t/p/w500/5M0j0B18abtBI5gi2RhfjjurTqb.jpg'),(2190,559969,'El Camino: A Breaking Bad Movie','In the wake of his dramatic escape from captivity, Jesse Pinkman must come to terms with his past in order to forge some kind of future.',312,123,'Crime',2019,6.8,'https://image.tmdb.org/t/p/w500/ePXuKdXZuJx8hHMNr2yM4jY2L7Z.jpg'),(2191,76341,'Mad Max: Fury Road','An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and most everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order.',316,121,'Action',2015,7.5,'https://image.tmdb.org/t/p/w500/sQuxceRcV3cxKH5CAnAUZe0qFKS.jpg'),(2192,122,'The Lord of the Rings: The Return of the King','Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron\'s forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord\'s realm.',299,201,'Adventure',2003,8.5,'https://image.tmdb.org/t/p/w500/rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg'),(2193,399579,'Alita: Battle Angel','When Alita awakens with no memory of who she is in a future world she does not recognize, she is taken in by Ido, a compassionate doctor who realizes that somewhere in this abandoned cyborg shell is the heart and soul of a young woman with an extraordinary past.',320,122,'Action',2019,7,'https://image.tmdb.org/t/p/w500/xRWht48C2V8XNfzvPehyClOvDni.jpg'),(2194,458156,'John Wick: Chapter 3 - Parabellum','Super-assassin John Wick returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin’s guild, the High Table, John Wick is excommunicado, but the world’s most ruthless hit men and women await his every turn.',324,131,'Action',2019,7.3,'https://image.tmdb.org/t/p/w500/ziEuG1essDuWuC5lpWUaw1uXY2O.jpg'),(2195,181812,'Star Wars: The Rise of Skywalker','The surviving Resistance faces the First Order once again as the journey of Rey, Finn and Poe Dameron continues. With the power and knowledge of generations behind them, the final battle begins.',278,142,'Action',2019,6.5,'https://image.tmdb.org/t/p/w500/db32LaOibwEliAmSL2jjDF6oDdj.jpg'),(2196,181808,'Star Wars: The Last Jedi','Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares to do battle with the First Order.',330,152,'Science Fiction',2017,7,'https://image.tmdb.org/t/p/w500/kOVEVeg59E0wsnXmF9nrh6OmWII.jpg'),(2197,246655,'X-Men: Apocalypse','After the re-emergence of the world\'s first mutant, world-destroyer Apocalypse, the X-Men must unite to defeat his extinction level plan.',332,144,'Action',2016,6.5,'https://image.tmdb.org/t/p/w500/2mtQwJKVKQrZgTz49Dizb25eOQQ.jpg'),(2198,36647,'Blade','When Blade\'s mother was bitten by a vampire during pregnancy, she did not know that she gave her son a special gift while dying—all the good vampire attributes in combination with the best human skills. Blade and his mentor battle an evil vampire rebel who plans to take over the outdated vampire council, capture Blade and resurrect a voracious blood god.',335,120,'Horror',1998,6.6,'https://image.tmdb.org/t/p/w500/PDuKQeQkRHkdx7rY147VBVN5Ef.jpg'),(2199,8536,'Superman II','Three escaped criminals from the planet Krypton test the Man of Steel\'s mettle. Led by General Zod, the Kryptonians take control of the White House and partner with Lex Luthor to destroy Superman and rule the world. But Superman, who attempts to make himself human in order to get closer to Lois, realizes he has a responsibility to save the planet.',339,127,'Science Fiction',1980,6.7,'https://image.tmdb.org/t/p/w500/r9ZRah6rYBoRuPyj8g5Ei411XNM.jpg'),(2200,141052,'Justice League','Fuelled by his restored faith in humanity and inspired by Superman\'s selfless act, Bruce Wayne and Diana Prince assemble a team of metahumans consisting of Barry Allen, Arthur Curry and Victor Stone to face the catastrophic threat of Steppenwolf and the Parademons who are on the hunt for three Mother Boxes on Earth.',230,120,'Action',2017,6.2,'https://image.tmdb.org/t/p/w500/eifGNCSDuxJeS1loAXil5bIGgvC.jpg'),(2201,1924,'Superman','Mild-mannered Clark Kent works as a reporter at the Daily Planet alongside his crush, Lois Lane. Clark must summon his superhero alter-ego when the nefarious Lex Luthor launches a plan to take over the world.',344,143,'Science Fiction',1978,7.1,'https://image.tmdb.org/t/p/w500/pyRc5TSuKS3jWLLbIoOyjqeLv6i.jpg'),(2202,1452,'Superman Returns','Superman returns to discover his 5-year absence has allowed Lex Luthor to walk free, and that those he was closest to felt abandoned and have moved on. Luthor plots his ultimate revenge that could see millions killed and change the face of the planet forever, as well as ridding himself of the Man of Steel.',332,154,'Science Fiction',2006,5.6,'https://image.tmdb.org/t/p/w500/6ZYOpyhFZrAQIe1BuhqVgzfAdGZ.jpg'),(2203,9738,'Fantastic Four','During a space voyage, four scientists are altered by cosmic rays: Reed Richards gains the ability to stretch his body; Sue Storm can become invisible; Johnny Storm controls fire; and Ben Grimm is turned into a super-strong … thing. Together, these \"Fantastic Four\" must now thwart the evil plans of Dr. Doom and save the world from certain destruction.',348,106,'Action',2005,5.7,'https://image.tmdb.org/t/p/w500/8HLQLILZLhDQWO6JDpvY6XJLH75.jpg'),(2204,102899,'Ant-Man','Armed with the astonishing ability to shrink in scale but increase in strength, master thief Scott Lang must embrace his inner-hero and help his mentor, Doctor Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.',351,117,'Science Fiction',2015,7.1,'https://image.tmdb.org/t/p/w500/fddtVEUozxvLmehR5yGZjem44pD.jpg'),(2205,383498,'Deadpool 2','Wisecracking mercenary Deadpool battles the evil and powerful Cable and other bad guys to save a boy\'s life.',354,119,'Action',2018,7.5,'https://image.tmdb.org/t/p/w500/to0spRl1CMDvyUbOnbb4fTk3VAd.jpg'),(2206,299537,'Captain Marvel','The story follows Carol Danvers as she becomes one of the universe’s most powerful heroes when Earth is caught in the middle of a galactic war between two alien races. Set in the 1990s, Captain Marvel is an all-new adventure from a previously unseen period in the history of the Marvel Cinematic Universe.',357,124,'Action',2019,7,'https://image.tmdb.org/t/p/w500/AtsgWhDnHTq68L0lLsUrCnM7TjG.jpg'),(2207,9531,'Superman III','Aiming to defeat the Man of Steel, wealthy executive Ross Webster hires bumbling but brilliant Gus Gorman to develop synthetic kryptonite, which yields some unexpected psychological effects in the third installment of the 1980s Superman franchise. Between rekindling romance with his high school sweetheart and saving himself, Superman must contend with a powerful supercomputer.',339,125,'Comedy',1983,5.4,'https://image.tmdb.org/t/p/w500/lsM42r8n6XR1KsPv5UyDbCfWH8L.jpg'),(2208,534,'Terminator Salvation','All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.',362,115,'Action',2009,6,'https://image.tmdb.org/t/p/w500/gw6JhlekZgtKUFlDTezq3j5JEPK.jpg'),(2209,605,'The Matrix Revolutions','The human city of Zion defends itself against the massive invasion of the machines as Neo fights to end the war at another front while also opposing the rogue Agent Smith.',93,129,'Adventure',2003,6.6,'https://image.tmdb.org/t/p/w500/cm14gG8xBghwIAy1GX0ryI2HA4U.jpg'),(2210,9323,'Ghost in the Shell','In the year 2029, the barriers of our world have been broken down by the net and by cybernetics, but this brings new vulnerability to humans in the form of brain-hacking. When a highly-wanted hacker known as \'The Puppetmaster\' begins involving them in politics, Section 9, a group of cybernetically enhanced cops, are called in to investigate and stop the Puppetmaster.',364,83,'Action',1995,7.9,'https://image.tmdb.org/t/p/w500/9gC88zYUBARRSThcG93MvW14sqx.jpg'),(2211,500664,'Upgrade','A brutal mugging leaves Grey Trace paralyzed in the hospital and his beloved wife dead. A billionaire inventor soon offers Trace a cure — an artificial intelligence implant called STEM that will enhance his body. Now able to walk, Grey finds that he also has superhuman strength and agility — skills he uses to seek revenge against the thugs who destroyed his life.',368,100,'Action',2018,7.4,'https://image.tmdb.org/t/p/w500/8fDtXi6gVw8WUMWGT9XFz7YwkuE.jpg'),(2212,23535,'Class of 1999','The time is in the future and the youth gang violence is so high that the areas around some schools have become \"free-fire zones\", into which not even the police will venture. When Miles Langford, the head of Kennedy High School, decides to take his school back from the gangs, robotics specialist Dr. Robert Forrest provides \"tactical education units\". These are amazingly human-like androids that have been programmed to teach and are supplied with devastatingly effective solutions to discipline problems. So when he violent, out-of-control students of Kennedy High report for class tomorrow, they\'re going to get a real education... in staying alive!',372,99,'Science Fiction',1990,6.2,'https://image.tmdb.org/t/p/w500/5HkKJhPODjCjVOoGcvHvo7tRgNU.jpg'),(2213,14092,'Ghost in the Shell 2.0','In the year 2029, Section 9, a group of cybernetically enhanced cops, are called in to investigate and stop a highly-wanted hacker known as \'The Puppetmaster\'.  Ghost in the Shell 2.0 is a reproduced version of its original 1995 counterpart. Among a numerous enhancements, for the film\'s 2.0 release, were a number of scenes were overhauled with 3D animation, visual improvements, and soundtrack rerecorded in 6.1 surround sound.',364,85,'Action',2008,7.5,'https://image.tmdb.org/t/p/w500/4Vzlmvb9EyTnr5kN8mFVCMs8f3I.jpg'),(2214,11309,'Hardware','Mark 13 is a government-built killing machine programmed with artificial intelligence, able to repair and recharge itself from any energy source. Through a series of coincidences, the cyborg\'s head ends up in the home of a sculptress as a bizarre Christmas present from her boyfriend. Once inside its new home, the cyborg promptly reconstructs the rest of its body using a variety of household utensils and proceeds to go on a murderous rampage.',377,93,'Horror',1990,5.7,'https://image.tmdb.org/t/p/w500/ybauOsdo6ColZ1WsALqIYjpUg4X.jpg'),(2215,10195,'Thor','Against his father Odin\'s will, The Mighty Thor - a powerful but arrogant warrior god - recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.',381,115,'Adventure',2011,6.7,'https://image.tmdb.org/t/p/w500/prSfAi1xGrhLQNxVSUFh61xQ4Qy.jpg'),(2216,44912,'Green Lantern','For centuries, a small but powerful force of warriors called the Green Lantern Corps has sworn to keep intergalactic order. Each Green Lantern wears a ring that grants him superpowers. But when a new enemy called Parallax threatens to destroy the balance of power in the Universe, their fate and the fate of Earth lie in the hands of the first human ever recruited.',383,114,'Adventure',2011,5.1,'https://image.tmdb.org/t/p/w500/fj21HwUprqjjwTdkKC1XZurRSpV.jpg'),(2217,155,'The Dark Knight','Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.',15,152,'Drama',2008,8.4,'https://image.tmdb.org/t/p/w500/qJ2tW6WMUDux911r6m7haRef0WH.jpg'),(2218,281,'Strange Days','Set in the year 1999 during the last days of the old millennium, the movie tells the story of Lenny Nero, an ex-cop who now deals with data-discs containing recorded memories and emotions. One day he receives a disc which contains the memories of a murderer killing a prostitute. Lenny investigates and is pulled deeper and deeper in a whirl of blackmail, murder and rape. Will he survive and solve the case?',388,145,'Crime',1995,7,'https://image.tmdb.org/t/p/w500/6cquF8GbEtNUlfz5yjbCoYzM9Pq.jpg'),(2219,9739,'Demolition Man','Simon Phoenix, a violent criminal cryogenically frozen in 1996, escapes during a parole hearing in 2032 in the utopia of San Angeles. Police are incapable of dealing with his violent ways and turn to his captor, who had also been cryogenically frozen after being wrongfully accused of killing 30 innocent people while apprehending Phoenix.',392,115,'Crime',1993,6.5,'https://image.tmdb.org/t/p/w500/49GjSZn9FnSnrRFmsA4x5WAj8oB.jpg'),(2220,59967,'Looper','In the futuristic action thriller Looper, time travel will be invented but it will be illegal and only available on the black market. When the mob wants to get rid of someone, they will send their target 30 years into the past where a looper, a hired gun, like Joe is waiting to mop up. Joe is getting rich and life is good until the day the mob decides to close the loop, sending back Joe\'s future self for assassination.',330,118,'Action',2012,6.8,'https://image.tmdb.org/t/p/w500/sNjL6SqErDBE8OUZlrDLkexfsCj.jpg'),(2221,97020,'RoboCop','In RoboCop, the year is 2028 and multinational conglomerate OmniCorp is at the center of robot technology.  Overseas, their drones have been used by the military for years, but have been forbidden for law enforcement in America.  Now OmniCorp wants to bring their controversial technology to the home front, and they see a golden opportunity to do it.  When Alex Murphy – a loving husband, father and good cop doing his best to stem the tide of crime and corruption in Detroit – is critically injured, OmniCorp sees their chance to build a part-man, part-robot police officer.  OmniCorp envisions a RoboCop in every city and even more billions for their shareholders, but they never counted on one thing: there is still a man inside the machine.',396,102,'Action',2014,5.8,'https://image.tmdb.org/t/p/w500/gM5ql3BKYmHG3WtZ0buKXN7xY8O.jpg'),(2222,10134,'Cyborg','A martial artist hunts a killer in a plague-infested urban dump of the future.',399,86,'Action',1989,5.1,'https://image.tmdb.org/t/p/w500/nOspcG8HP6KPdMvzezavRbzYCEw.jpg'),(2223,10474,'The Basketball Diaries','Film adaptation of street tough Jim Carroll\'s epistle about his kaleidoscopic free fall into the harrowing world of drug addiction.',403,102,'Drama',1995,7.3,'https://image.tmdb.org/t/p/w500/9qX10tQz0hvppk30CDrz73fZTPQ.jpg'),(2224,9655,'She\'s the Man','Viola Johnson is in a real jam. Complications threaten her scheme to pose as her twin brother, Sebastian, and take his place at a new boarding school. She falls in love with her handsome roommate, Duke, who loves beautiful Olivia, who has fallen for Sebastian! As if that were not enough, Viola\'s twin returns from London ahead of schedule but has no idea that his sister has already replaced him on campus.',406,105,'Comedy',2006,6.6,'https://image.tmdb.org/t/p/w500/8exPgs8jLGh26BGSrAyHa9MeFyO.jpg'),(2225,9390,'Jerry Maguire','Jerry Maguire used to be a typical sports agent: willing to do just about anything he could to get the biggest possible contracts for his clients, plus a nice commission for himself. Then, one day, he suddenly has second thoughts about what he\'s really doing. When he voices these doubts, he ends up losing his job and all of his clients, save Rod Tidwell, an egomaniacal football player.',410,139,'Comedy',1996,6.9,'https://image.tmdb.org/t/p/w500/2FJFChUeEgYpCvsLfAMXjcFtFOy.jpg'),(2226,10637,'Remember the Titans','After leading his football team to 15 winning seasons, coach Bill Yoast is demoted and replaced by Herman Boone – tough, opinionated and as different from the beloved Yoast as he could be. The two men learn to overcome their differences and turn a group of hostile young men into champions.',414,113,'Drama',2000,7.6,'https://image.tmdb.org/t/p/w500/825ohvC4wZ3gCuncCaqkWeQnK8h.jpg'),(2227,389015,'I, Tonya','Competitive ice skater Tonya Harding rises amongst the ranks at the U. S. Figure Skating Championships, but her future in the sport is thrown into doubt when her ex-husband intervenes.',418,120,'Drama',2017,7.5,'https://image.tmdb.org/t/p/w500/6gNXwSHxaksR1PjVZRqNapmkgj3.jpg'),(2228,60308,'Moneyball','The story of Oakland Athletics general manager Billy Beane\'s successful attempt to put together a baseball team on a budget, by employing computer-generated analysis to draft his players.',422,134,'Drama',2011,7.2,'https://image.tmdb.org/t/p/w500/4yIQq1e6iOcaZ5rLDG3lZBP3j7a.jpg'),(2229,22881,'The Blind Side','The story of Michael Oher, a homeless and traumatized boy who became an All American football player and first round NFL draft pick with the help of a caring woman and her family.',425,129,'Drama',2009,7.6,'https://image.tmdb.org/t/p/w500/bMgq7VBriuBFknXEe9E9pVBYGZq.jpg'),(2230,9563,'Any Given Sunday','A star quarterback gets knocked out of the game and an unknown third stringer is called in to replace him. The unknown gives a stunning performance and forces the ageing coach to reevaluate his game plans and life. A new co-owner/president adds to the pressure of winning. The new owner must prove herself in a male dominated world.',428,157,'Drama',1999,6.9,'https://image.tmdb.org/t/p/w500/lRl3lspTUkTjWgyCm6KAJcTXict.jpg'),(2231,369972,'First Man','A look at the life of the astronaut, Neil Armstrong, and the legendary space mission that led him to become the first man to walk on the Moon on July 20, 1969.',192,141,'History',2018,7.1,'https://image.tmdb.org/t/p/w500/i91mfvFcPPlaegcbOyjGgiWfZzh.jpg'),(2232,522924,'The Art of Racing in the Rain','A family dog—with a near-human soul and a philosopher\'s mind—evaluates his life through the lessons learned by his human owner, a race-car driver.',431,109,'Comedy',2019,8.4,'https://image.tmdb.org/t/p/w500/mi5VN4ww0JZgRFJIaPxxTGKjUg7.jpg'),(2233,3558,'Girl, Interrupted','Set in the changing world of the late 1960s, Susanna Kaysen\'s prescribed \"short rest\" from a psychiatrist she had met only once becomes a strange, unknown journey into Alice\'s Wonderland, where she struggles with the thin line between normal and crazy. Susanna soon realizes how hard it is to get out once she has been committed, and she ultimately has to choose between the world of people who belong inside or the difficult world of reality outside.',178,127,'Drama',1999,7.6,'https://image.tmdb.org/t/p/w500/dOBdatHIVppvmRFw2z7bf9VKJr9.jpg'),(2234,319888,'Eddie the Eagle','The feel-good story of Michael \'Eddie\' Edwards, an unlikely but courageous British ski-jumper who never stopped believing in himself—even as an entire nation was counting him out. With the help of a rebellious and charismatic coach, Eddie takes on the establishment and wins the hearts of sports fans around the world by making an improbable and historic showing at the 1988 Calgary Winter Olympics.',437,106,'Comedy',2016,7.2,'https://image.tmdb.org/t/p/w500/ekdfoZpHlye4GepsEaB2WTLhdvW.jpg'),(2235,423899,'Victoria & Abdul','Queen Victoria strikes up an unlikely friendship with a young Indian clerk named Abdul Karim.',441,112,'Drama',2017,6.9,'https://image.tmdb.org/t/p/w500/a5vm7eBHLfBqaOMQUUAVxXmgmhA.jpg'),(2236,14112,'Auto Focus','A successful TV star during the 1960s, former \"Hogan\'s Heroes\" actor Bob Crane projects a wholesome family-man image, but this front masks his persona as a sex addict who records and photographs his many encounters with women, often with the help of his seedy friend, John Henry Carpenter. This biographical drama reveals how Crane\'s double life takes its toll on him and his family, and ultimately contributes to his death',445,104,'Crime',2002,6.3,'https://image.tmdb.org/t/p/w500/mKg09w76HFvhGRWpcGszVwdQEsu.jpg'),(2237,398,'Capote','A biopic of the writer, Truman Capote and his assignment for The New Yorker to write the non-fiction book, \'In Cold Blood\'.',422,114,'Crime',2005,7,'https://image.tmdb.org/t/p/w500/k7z0tDxzbDNev7F8l3Y56Pk5seR.jpg'),(2238,381289,'A Dog\'s Purpose','A dog goes on quest to discover his purpose in life over the course of several lifetimes with multiple owners.',450,100,'Comedy',2017,7.4,'https://image.tmdb.org/t/p/w500/3jcNvhtVQe5Neoffdic39fRactM.jpg'),(2239,11528,'The Sandlot','In the summer of 1962, a new kid in town is taken under the wing of a young baseball prodigy and his rowdy team, resulting in many adventures.',453,101,'Comedy',1993,7.3,'https://image.tmdb.org/t/p/w500/oaHqvSFTd0yrh5hjAafDxR0UPdN.jpg'),(2240,2323,'Field of Dreams','Ray Kinsella is an Iowa farmer who hears a mysterious voice telling him to turn his cornfield into a baseball diamond. He does, but the voice\'s directions don\'t stop -- even after the spirits of deceased ballplayers turn up to play.',456,107,'Drama',1989,7.2,'https://image.tmdb.org/t/p/w500/8PT4sAcneQ7MtZ1Mqoe2EyOJHmZ.jpg'),(2241,192132,'Palo Alto','Palo Alto weaves together three stories of teenage lust, boredom, and self-destruction: shy, sensitive April, torn between an illicit flirtation with her soccer coach and an unrequited crush on sweet stoner Teddy; Emily, who offers sexual favors to any boy to cross her path; and the increasingly dangerous exploits of Teddy and his best friend Fred, whose behavior may or may not be sociopathic.',459,100,'Drama',2014,6.3,'https://image.tmdb.org/t/p/w500/mSxRUyOnfvkk8pepSJqXjoHryyi.jpg'),(2242,264644,'Room','Jack is a young boy of 5 years old who has lived all his life in one room. He believes everything within it are the only real things in the world. But what will happen when his Ma suddenly tells him that there are other things outside of Room?',463,117,'Drama',2015,8.1,'https://image.tmdb.org/t/p/w500/pCURNjeomWbMSdiP64gj8NVVHTQ.jpg'),(2243,296,'Terminator 3: Rise of the Machines','It\'s been 10 years since John Connor saved Earth from Judgment Day, and he\'s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor\'s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.',466,109,'Action',2003,6,'https://image.tmdb.org/t/p/w500/jdG3l2e7kJ4bl91YLRLUAmvbZMX.jpg'),(2244,604,'The Matrix Reloaded','Six months after the events depicted in The Matrix, Neo has proved to be a good omen for the free humans, as more and more humans are being freed from the matrix and brought to Zion, the one and only stronghold of the Resistance.  Neo himself has discovered his superpowers including super speed, ability to see the codes of the things inside the matrix and a certain degree of pre-cognition. But a nasty piece of news hits the human resistance: 250,000 machine sentinels are digging to Zion and would reach them in 72 hours. As Zion prepares for the ultimate war, Neo, Morpheus and Trinity are advised by the Oracle to find the Keymaker who would help them reach the Source.  Meanwhile Neo\'s recurrent dreams depicting Trinity\'s death have got him worried and as if it was not enough, Agent Smith has somehow escaped deletion, has become more powerful than before and has fixed Neo as his next target.',93,138,'Adventure',2003,6.9,'https://image.tmdb.org/t/p/w500/aA5qHS0FbSXO8PxcxUIHbDrJyuh.jpg'),(2245,290859,'Terminator: Dark Fate','Decades after Sarah Connor prevented Judgment Day, a lethal new Terminator is sent to eliminate the future leader of the resistance. In a fight to save mankind, battle-hardened Sarah Connor teams up with an unexpected ally and an enhanced super soldier to stop the deadliest Terminator yet.',78,128,'Action',2019,6.5,'https://image.tmdb.org/t/p/w500/i8QWXu6dGuTKKerJtnd0A4lUpbv.jpg'),(2246,262543,'Automata','Jacq Vaucan, an insurance agent of ROC robotics corporation, routinely investigates the case of manipulating a robot. What he discovers will have profound consequences for the future of humanity.',470,110,'Thriller',2014,5.7,'https://image.tmdb.org/t/p/w500/jfyoVAjWCQRJ14s4PVwlSvOu7M6.jpg'),(2247,2048,'I, Robot','In 2035, where robots are common-place and abide by the three laws of robotics, a techno-phobic cop investigates an apparent suicide. Suspecting that a robot may be responsible for the death, his investigation leads him to believe that humanity may be in danger.',473,115,'Action',2004,6.9,'https://image.tmdb.org/t/p/w500/zDu0TsCZHPzDO0d0iG9QynKGr4J.jpg'),(4038,297762,'Wonder Woman','An Amazon princess comes to the world of Man in the grips of the First World War to confront the forces of evil and bring an end to human conflict.',532,141,'Action',2017,7.3,'https://image.tmdb.org/t/p/w500/gfJGlDaHuWimErCr5Ql0I8x9QSy.jpg'),(4039,263115,'Logan','In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan\'s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.',178,137,'Action',2017,7.8,'https://image.tmdb.org/t/p/w500/fnbjcRDYn6YviCcePDnGdyAkYsB.jpg'),(4040,497698,'Black Widow','Natasha Romanoff, also known as Black Widow, confronts the darker parts of her ledger when a dangerous conspiracy with ties to her past arises. Pursued by a force that will stop at nothing to bring her down, Natasha must deal with her history as a spy and the broken relationships left in her wake long before she became an Avenger.',537,0,'Action',2020,0,'https://image.tmdb.org/t/p/w500/uAUCHOYwFKQvSRZByP8rCgWKwT.jpg'),(4041,580489,'Venom: Let There Be Carnage','Sequel to the box-office hit film \"Venom.\"',541,0,'Action',2021,0,'https://image.tmdb.org/t/p/w500/wi0w3uNtvHdMqPtOA6meuqn8y6r.jpg'),(4042,447365,'Guardians of the Galaxy Vol. 3','The third film based on Marvel\'s Guardians of the Galaxy.',42,0,'Action',2023,0,'https://image.tmdb.org/t/p/w500/6rsLfXqlZSXa6zLfbofHVhXs8Yr.jpg'),(4043,78,'Blade Runner','In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.',82,118,'Science Fiction',1982,7.9,'https://image.tmdb.org/t/p/w500/vfzE3pjE5G7G7kcZWrA3fnbZo7V.jpg'),(4044,9880,'The Princess Diaries','A socially awkward but very bright 15-year-old girl being raised by a single mom discovers that she is the princess of a small European country because of the recent death of her long-absent father, who, unknown to her, was the crown prince of Genovia. She must make a choice between continuing the life of a San Francisco teen or stepping up to the throne.',546,115,'Comedy',2001,6.8,'https://image.tmdb.org/t/p/w500/wA4lgl8gmoICSShviCkEB61nIBB.jpg'),(4045,675,'Harry Potter and the Order of the Phoenix','Returning for his fifth year of study at Hogwarts, Harry is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students – dubbed \'Dumbledore\'s Army\' – to defend themselves against the dark arts.',65,138,'Adventure',2007,7.7,'https://image.tmdb.org/t/p/w500/5aOyriWkPec0zUDxmHFP9qMmBaj.jpg'),(4046,671,'Harry Potter and the Philosopher\'s Stone','Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths -- and about the villain who\'s to blame.',549,152,'Adventure',2001,7.9,'https://image.tmdb.org/t/p/w500/wuMc08IPKEatf9rnMNXvIDxqP4W.jpg'),(4047,32293,'The Cheetah Girls','A four-member teen girl group named the Cheetah Girls go to a Manhattan High School for the Performing Arts and try to become the first freshmen to win the talent show in the school\'s history. During the talent show auditions, they meet a big-time producer named Jackal Johnson, who tries to make the group into superstars, but the girls run into many problems.',550,93,'Comedy',2003,5.6,'https://image.tmdb.org/t/p/w500/2n813ySvmLdGV1CohEne7nAjUd2.jpg'),(4048,50479,'Avalon High','Disney Channel\'s production of Julie Sherman Wolfe\'s screenplay adaptation of the popular novel Avalon High by Meg Cabot. Elaine \"Ellie\" Harrison has just moved from Minnesota to Annapolis, Maryland while her parents take a year long sabbatical to continue their medieval studies in nearby DC. Her new high school, Avalon High, seems like a typical high school with the stereotypical students: Lance the jock, Jennifer the cheerleader, Marco, the bad boy/desperado, and Will, the senior class president, quarterback, and all around good guy. But not everyone at Avalon High is who they appear to be, not even Ellie herself. Eventually, it becomes apparent that Avalon High is a situation where the ancient Arthurian legend is repeating itself. Will, Jennifer, Lance, Marco, and Mr. Morton all correspond to King Arthur, Queen Guinevere, Knight Lancelot, Mordred, and Merlin, respectively.',554,91,'TV Movie',2011,6.2,'https://image.tmdb.org/t/p/w500/7SlrslE7HUjCcx8WSYPkgbv5lqW.jpg'),(4049,81250,'Geek Charming','Dylan Schoenfield is the pink princess of the upscale Los Angeles Woodlands Academy. She has the coolest boyfriend, the most popular friends, and a brand-new it bag that everyone covets. But when she accidentally tosses her Serge Sanchez bag into a fountain, this princess comes face-to-face with her own personal frog, self-professed film geek Josh Rosen. In return for rescuing Dylan\'s bag, Josh convinces Dylan to let him film her for his documentary on high school popularity. Reluctantly, Dylan lets F-list Josh into her A-list world, and is shocked to realize that sometimes nerds can be pretty cool. But when Dylan\'s so-called prince charming of a boyfriend dumps her flat, her life and her social status comes to a crashing halt. Can Dylan win the Woodlands Academy Fall Formal Blossom Queen crown? Can Josh win the Woodlands Academy 10th Annual Film Festival? Can Dylan, with Josh\'s help, pull the pieces together to create her own happily-ever-after?',557,97,'Comedy',2011,6.4,'https://image.tmdb.org/t/p/w500/qtCEXH7cyCxOjjZyxDzqnDQeGZY.jpg'),(4050,68737,'Seventh Son','John Gregory, who is a seventh son of a seventh son and also the local spook, has protected the country from witches, boggarts, ghouls and all manner of things that go bump in the night. However John is not young anymore, and has been seeking an apprentice to carry on his trade. Most have failed to survive. The last hope is a young farmer\'s son named Thomas Ward. Will he survive the training to become the spook that so many others couldn\'t?',561,102,'Adventure',2014,5.3,'https://image.tmdb.org/t/p/w500/jF68dgdMY2sHjzM3iwozcquWkRe.jpg'),(4051,283378,'Fallen','Lucinda Price is sent to a reform academy under the assumption that she has killed a boy. There, she meets two mysterious boys, Cam and Daniel, to whom she feels drawn to both. But as the love triangle unfurls, it is Daniel that Luce cannot keep herself away from, and things begin to take a darker turn when she finds out his true identity.',564,91,'Drama',2016,6,'https://image.tmdb.org/t/p/w500/usGCM7wiUQhijEwz39brIaoGlVa.jpg'),(4052,68728,'Oz the Great and Powerful','Oscar Diggs, a small-time circus illusionist and con-artist, is whisked from Kansas to the Land of Oz where the inhabitants assume he\'s the great wizard of prophecy, there to save Oz from the clutches of evil.',567,130,'Fantasy',2013,5.9,'https://image.tmdb.org/t/p/w500/7lBgN59T5m1DaC9XcLkHOXdK9ax.jpg'),(4053,68735,'Warcraft','The peaceful realm of Azeroth stands on the brink of war as its civilization faces a fearsome race of invaders: orc warriors fleeing their dying home to colonize another. As a portal opens to connect the two worlds, one army faces destruction and the other faces extinction. From opposing sides, two heroes are set on a collision course that will decide the fate of their family, their people, and their home.',571,123,'Action',2016,6.3,'https://image.tmdb.org/t/p/w500/k3a41SS1q5xmbvzPvzTIfG7GDlp.jpg'),(4054,37933,'Tales from Earthsea','Something bizarre has come over the land. The kingdom is deteriorating. People are beginning to act strange... What\'s even more strange is that people are beginning to see dragons, which shouldn\'t enter the world of humans. Due to all these bizarre events, Ged, a wandering wizard, is investigating the cause. During his journey, he meets Prince Arren, a young distraught teenage boy. While Arren may look like a shy young teen, he has a severe dark side, which grants him strength, hatred, ruthlessness and has no mercy, especially when it comes to protecting Teru. For the witch Kumo this is a perfect opportunity. She can use the boy\'s \"fears\" against the very one who would help him, Ged.',575,115,'Adventure',2006,6.6,'https://image.tmdb.org/t/p/w500/67yYwCPq7NbxSF6BIIXCMD34sY0.jpg'),(4055,10140,'The Chronicles of Narnia: The Voyage of the Dawn Treader','This time around Edmund and Lucy Pevensie, along with their pesky cousin Eustace Scrubb find themselves swallowed into a painting and on to a fantastic Narnian ship headed for the very edges of the world.',579,113,'Adventure',2010,6.4,'https://image.tmdb.org/t/p/w500/pP27zlm9yeKrCeDZLFLP2HKELot.jpg'),(4056,37430,'Conan the Barbarian','A quest that begins as a personal vendetta for the fierce Cimmerian warrior soon turns into an epic battle against hulking rivals, 