e West is the only thing that could stop them.',591,102,'Adventure',1939,7.5,'https://image.tmdb.org/t/p/w500/mkFyFkF5KXVcb8Hf8Dj0KZuew2u.jpg'),(4061,672,'Harry Potter and the Chamber of Secrets','Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.',549,161,'Adventure',2002,7.7,'https://image.tmdb.org/t/p/w500/sdEOH0992YZ0QSxgXNIGLq1ToUi.jpg'),(4062,9100,'The Craft','A Catholic school newcomer falls in with a clique of teen witches who wield their powers against all who dare to cross them -- be they teachers, rivals or meddlesome parents.',595,101,'Fantasy',1996,6.5,'https://image.tmdb.org/t/p/w500/8UCScpzQbeJcSkY7ZgRpblYh0lP.jpg'),(4063,673,'Harry Potter and the Prisoner of Azkaban','Harry, Ron and Hermione return to Hogwarts for another magic-filled year. Harry comes face to face with danger yet again, this time in the form of escaped convict, Sirius Black—and turns to sympathetic Professor Lupin for help.',598,141,'Adventure',2004,8,'https://image.tmdb.org/t/p/w500/uDQibffYgssdiqx7izO57wdLc6.jpg'),(4064,847,'Willow','Fearful of a prophecy stating that a girl child will be born to bring about her downfall, the evil Queen Bavmorda imprisons all pregnant women within the formidable stronghold of Nockmaar. A child, Elora Danan, is born in the Nockmaar dungeons and identified as the prophesied child by a birthmark on her arm. However, before the black sorceress arrives to claim the child, Elora\'s mother convinces her reluctant midwife to escape with the baby. Willow, a timid farmer and aspiring sorcerer, is entrusted with delivering the royal infant from evil.',219,126,'Action',1988,7,'https://image.tmdb.org/t/p/w500/6tXkG9r7Lt1w7tmOguJdYcRbyYO.jpg'),(5793,25196,'Crazy Heart','When reporter, Jean Craddock interviews Bad Blake—an alcoholic, seen-better-days country music legend—they connect, and the hard-living crooner sees a possible saving grace in a life with Jean and her young son.',653,112,'Drama',2009,7,'https://image.tmdb.org/t/p/w500/zwao2YMsqf27IzNEtDNWSe0W9jH.jpg'),(5794,525,'The Blues Brothers','Jake Blues is just out of jail, and teams up with his brother, Elwood on a \'mission from God\' to raise funds for the orphanage in which they grew up. The only thing they can do is do what they do best: play music. So they get their old band together, and set out on their way—while getting in a bit of trouble here and there.',656,148,'Music',1980,7.7,'https://image.tmdb.org/t/p/w500/3DiSrcYELCLkwnjl9EZp2pkKGep.jpg'),(5795,254470,'Pitch Perfect 2','The Bellas are back, and they are better than ever. After being humiliated in front of none other than the President of the United States of America, the Bellas are taken out of the Aca-Circuit. In order to clear their name, and regain their status, the Bellas take on a seemingly impossible task: winning an international competition no American team has ever won. In order to accomplish this monumental task, they need to strengthen the bonds of friendship and sisterhood and blow away the competition with their amazing aca-magic! With all new friends and old rivals tagging along for the trip, the Bellas can hopefully accomplish their dreams.',660,115,'Comedy',2015,6.9,'https://image.tmdb.org/t/p/w500/25gcRJC8EmCfVUiFv6rjN0zBSJM.jpg'),(5796,504608,'Rocketman','The story of Elton John\'s life, from his years as a prodigy at the Royal Academy of Music through his influential and enduring musical partnership with Bernie Taupin.',437,121,'Drama',2019,7.4,'https://image.tmdb.org/t/p/w500/f4FF18ia7yTvHf2izNrHqBmgH8U.jpg'),(5797,491283,'Judy','Winter 1968 and showbiz legend Judy Garland arrives in Swinging London to perform a five-week sold-out run at The Talk of the Town. It is 30 years since she shot to global stardom 