ust plain weird gals, Beca finds that the only thing they have in common is how well they sing together. She takes the women of the group out of their comfort zone of traditional arrangements and into a world of amazing harmonic combinations in a fight to the top of college music competitions.',678,112,'Comedy',2012,7.3,'https://image.tmdb.org/t/p/w500/wl0jgLrUN18xkx9cQF5GoafcDhy.jpg'),(5802,318044,'What Happened, Miss Simone?','The film chronicles Nina Simone\'s journey from child piano prodigy to iconic musician and passionate activist, told in her own words.',680,101,'Documentary',2015,7.6,'https://image.tmdb.org/t/p/w500/zfU6mfxPns34TRwxKhp5pyBIgJt.jpg'),(5803,6557,'27 Dresses','Altruistic Jane finds herself facing her worst nightmare as her younger sister announces her engagement to the man Jane secretly adores.',684,111,'Comedy',2008,6.3,'https://image.tmdb.org/t/p/w500/rEfourJfgEyKiewwH8ZkUYt9AqE.jpg'),(5804,6477,'Alvin and the Chipmunks','A struggling songwriter named Dave Seville finds success when he comes across a trio of singing chipmunks: mischievous leader Alvin, brainy Simon, and chubby, impressionable Theodore.',688,92,'Comedy',2007,5.7,'https://image.tmdb.org/t/p/w500/fONOOf3RmWnCKFwSl9e0z61KlZs.jpg'),(5805,786,'Almost Famous','In 1973, 15-year-old William Miller\'s unabashed love of music and aspiration to become a rock journalist lands him an assignment from Rolling Stone magazine to interview and tour with the up-and-coming band Stillwater—fronted by lead guitar Russell Hammond, and lead singer Jeff Bebe.',410,122,'Drama',2000,7.5,'https://image.tmdb.org/t/p/w500/tl1Yv7lWq3RUPq3Q1nT5oRFJsv8.jpg'),(5806,13374,'Ice Princess','With the help of her coach, her parents, and the boy who drives the Zamboni machine, nothing can stop Casey from realizing her dream to be a champion figure skater.',695,98,'Drama',2005,6.2,'https://image.tmdb.org/t/p/w500/jf0i8Sn4nhDQblDMTtCg2KTRjQU.jpg'),(5807,13969,'First Daughter','Samantha MacKenzie, the daughter of the president of the United States, arrives at college with a group of Secret Service agents. Samantha, however, resents their presence and decides she wants to attend school just like a normal student. Her father agrees to recall the agents but secretly assigns James, an undercover agent, to pose as a student. They fall in love, but their romance is jeopardized when Samantha learns James\' true identity.',229,105,'Comedy',2004,6,'https://image.tmdb.org/t/p/w500/2KF5IpPvrLlYHQkn3Dvbbe4gz2F.jpg'),(5808,440021,'Happy Death Day','Caught in a bizarre and terrifying time warp, college student Tree finds herself repeatedly reliving the day of her murder, ultimately realizing that she must identify the killer and the reason for her death before her chances of survival run out.',701,97,'Horror',2017,6.6,'https://image.tmdb.org/t/p/w500/cTaEIUYTt52ooq9quVbAQ7NpGwo.jpg'),(5809,8277,'American Pie Presents: Beta House','Erik, Ryan, and Cooze start college and pledge the Beta House fraternity, presided over by none other than legendary Dwight Stifler. But chaos ensues when a fraternity of geeks threatens to stop the debauchery and the Betas have to make a stand for their right to party.',705,88,'Comedy',2007,5.5,'https://image.tmdb.org/t/p/w500/cEJMqmCGdKJkmjWwi3Iv6l4kMIK.jpg'),(5810,10760,'Sydney White','A modern retelling of Snow White set against students in their freshman year of college in the greek system.',709,108,'Comedy',2007,6.4,'https://image.tmdb.org/t/p/w500/ce3NNmhVZY5NkUe5Y8Je8CciKqf.jpg'),(5811,205015,'Four Sisters and a Wedding','The children of the Salazar family have been pursuing separate lives in the recent years. After a few years of not being together as a whole family, they find themselves reuniting when CJ announces his plan to marry Princess, his girlfriend for three months. Much to their shock and dismay, CJ\'s sisters come together for the wedding and have agreed to dissuade him from marrying his fiancée.',712,126,'Family',2013,6,'https://image.tmdb.org/t/