le curse to prick her finger on the spindle of a spinning wheel and fall into a deep sleep that can only be awakened by true love\'s first kiss. Determined to protect her, her parents ask three fairies to raise her in hiding. But the evil Maleficent is just as determined to seal the princess\'s fate.',739,75,'Fantasy',1959,6.9,'https://image.tmdb.org/t/p/w500/hsQD3U3P8wkU63jgKg9TlK5oxK3.jpg'),(5819,809,'Shrek 2','Shrek, Fiona and Donkey set off to Far, Far Away to meet Fiona\'s mother and father. But not everyone is happy. Shrek and the King find it hard to get along, and there\'s tension in the marriage. The fairy godmother discovers that Shrek has married Fiona instead of her Son Prince Charming and sets about destroying their marriage.',589,93,'Adventure',2004,7,'https://image.tmdb.org/t/p/w500/2yYP0PQjG8zVqturh1BAqu2Tixl.jpg'),(5820,808,'Shrek','It ain\'t easy bein\' green -- especially if you\'re a likable (albeit smelly) ogre named Shrek. On a mission to retrieve a gorgeous princess from the clutches of a fire-breathing dragon, Shrek teams up with an unlikely compatriot -- a wisecracking donkey.',589,90,'Adventure',2001,7.6,'https://image.tmdb.org/t/p/w500/o04jZs5SXhbvhqO4981W7KJXOWZ.jpg'),(5821,11976,'Legend','Set in a timeless mythical forest inhabited by fairies, goblins, unicorns and mortals, this fantastic story follows a mystical forest dweller, chosen by fate, to undertake a heroic quest. He must save the beautiful Princess  Lili and defeat the demonic Lord of Darkness, or the world will be plunged into a never-ending ice age.',82,94,'Adventure',1985,6.3,'https://image.tmdb.org/t/p/w500/bfOmGFHyJCPyusJhxm2VoAf7DkN.jpg'),(5822,10144,'The Little Mermaid','This colorful adventure tells the story of an impetuous mermaid princess named Ariel who falls in love with the very human Prince Eric and puts everything on the line for the chance to be with him. Memorable songs and characters -- including the villainous sea witch Ursula.',747,83,'Animation',1989,7.3,'