hrown him into a time loop.',815,113,'Action',2014,7.6,'https://image.tmdb.org/t/p/w500/uUHvlkLavotfGsNtosDy8ShsIYF.jpg'),(6995,449176,'Love, Simon','Everyone deserves a great love story. But for seventeen-year old Simon Spier it\'s a little more complicated: he\'s yet to tell his family or friends he\'s gay and he doesn\'t know the identity of the anonymous classmate he\'s fallen for online.',817,110,'Comedy',2018,8.1,'https://image.tmdb.org/t/p/w500/5YUYg5q7QfC4IoNwNUtiwdiYKPr.jpg'),(6996,186992,'Stranger by the Lake','Summertime. A cruising spot for men, tucked away on the shores of a lake. Franck falls in love with Michel, an attractive, potent and lethally dangerous man. Franck knows this, but wants to live out his passion anyway.',821,97,'Drama',2013,6.3,'https://image.tmdb.org/t/p/w500/mbKnpwPwYlWu0Y48DVuy58H6CUg.jpg'),(6997,197033,'Geography Club','A coming-of-age movie that tells a story unfolding in every high school around the country -- a story of kids hiding their true identities in plain sight, even as they feverishly pursue their hearts\' desires.',825,79,'Comedy',2013,6.5,'https://image.tmdb.org/t/p/w500/oPwDoem41nOxe1tEI5p65tYTbpe.jpg'),(6998,376867,'Moonlight','The tender, heartbreaking story of a young man’s struggle to find himself, told across three defining chapters in his life as he experiences the ecstasy, pain, and beauty of falling in love, while grappling with his own sexuality.',829,111,'Drama',2016,7.4,'https://image.tmdb.org/t/p/w500/93NN95a71MsQ4tR2zSLv8BNK2qh.jpg'),(6999,84892,'The Perks of Being a Wallflower','Pittsburgh, Pennsylvania, 1991. High school freshman Charlie is a wallflower, always watching life from the sidelines, until two senior students, Sam and her stepbrother Patrick, become his mentors, helping him discover the joys of friendship, music and love…',832,103,'Drama',2012,7.7,'https://image.tmdb.org/t/p/w500/aKCvdFFF5n80P2VdS7d8YBwbCjh.jpg'),(7000,467952,'The Catcher Was a Spy','Major league baseball player, Moe Berg, 