ars, police inaction drives her own investigation into the gated Long Island community where Shannan was last seen. Her search brings attention to over a dozen murdered sex workers.',680,95,'Drama',2020,6.1,'https://image.tmdb.org/t/p/w500/pDas4DwURlRzjD9xEhSdtkcl1ZV.jpg'),(7010,11092,'Presumed Innocent','Rusty Sabich is a deputy prosecutor engaged in an obsessive affair with a coworker who is murdered. Soon after, he\'s accused of the crime. And his fight to clear his name becomes a whirlpool of lies and hidden passions.',864,127,'Thriller',1990,6.8,'https://image.tmdb.org/t/p/w500/jSPWptOsqU1nxXQe6muSPB0kD3c.jpg'),(7011,239529,'Lupin the Third vs. Detective Conan: The Movie','Conan Edogawa sets out to apprehend Lupin the Third, the suspect of stealing a jewel called Cherry Sapphire. A sequel to the TV special “Lupin the Third vs. Detective Conan” (2009).',867,106,'Action',2013,6.8,'https://image.tmdb.org/t/p/w500/p3FnegNtmeAKuMWXrce9JDmJw4Y.jpg'),(7012,34433,'Dragon Ball Z: Broly – The Legendary Super Saiyan','While the Saiyan Paragus persuades Vegeta to rule a new planet, King Kai alerts Goku of the South Galaxy\'s destruction by an unknown Super Saiyan.',871,70,'Animation',1993,7.2,'https://image.tmdb.org/t/p/w500/faYggmY3FHQCMPKmnjORQygF6zm.jpg'),(7013,128,'Princess Mononoke','Ashitaka, a prince of the disappearing Emishi people, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.',156,134,'Adventure',1997,8.3,'https://image.tmdb.org/t/p/w500/pdtzEreKvKAlqa2YEBaGwiA45V8.jpg'),(7014,110420,'Wolf Children','After her werewolf lover unexpectedly dies in an accident, a woman must find a way to raise the son and daughter that she had with him. However, their inheritance of their father\'s traits prove to be a challenge for her.',877,117,'Animation',2012,8.2,'https://image.tmdb.org/t/p/w500/nqqovhsvsWbsb7LcGaIGDRZrwgB.jpg'),(7015,378064,'A Silent Voice','Shouya Ishida starts bullying the new girl in class, Shouko Nishimiya, because she is deaf. But as the teasing continues, the rest of the class starts to turn on Shouya for his lack of compassion. When they leave elementary school, Shouko and Shouya do not speak to each other again... until an older, wiser Shouya, tormented by his past behaviour, decides he must see Shouko once more. He wants to atone for his sins, but is it already too late...?',881,130,'Drama',2016,8.3,'https://image.tmdb.org/t/p/w500/drlyoSKDOPnxzJFrRWGqzDsyJvR.jpg'),(7016,12429,'Ponyo','The son of a sailor, 5-year old Sosuke lives a quiet life on an oceanside cliff with his mother Lisa. One fateful day, he finds a beautiful goldfish trapped in a bottle on the beach and upon rescuing her, names her Ponyo. But she is no ordinary goldfish. The daughter of a masterful wizard and a sea goddess, Ponyo uses her father\'s magic to transform herself into a young girl and quickly falls in love with Sosuke, but the use of such powerful sorcery causes a dangerous imbalance in the world. As the moon steadily draws nearer to the earth and Ponyo\'s father sends the ocean\'s mighty waves to find his daughter, the two children embark on an adventure of a lifetime to save the world and fulfill Ponyo\'s dreams of becoming human.',156,100,'Animation',2008,7.7,'https://image.tmdb.org/t/p/w500/yp8vEZflGynlEylxEesbYasc06i.jpg'),(7017,83389,'From Up on Poppy Hill','A group of Yokohama students fight to save their school\'s clubhouse from the wrecking ball during preparations for the 1964 Tokyo Olympic Games. While working there, Umi and Shun gradually become attracted to each other but have to face a sudden trial. Even so, they keep going without fleeing the difficulties of reality.',575,91,'Animation',2011,7.6,'https://image.tmdb.org/t/p/w500/pLPvpMwD4fkLs3mki87NxTP1Yjc.jpg'),(7018,51739,'The Secret World of Arrietty','14-year-old Arrietty and the rest of the Clock family live in peaceful anonymity as they make their own home from items \"borrowed\" from the house\'s human inhabitants. However, life changes for the Clocks when a human boy discovers Arrietty.',890,94,'Fantasy',2010,7.6,'https://image.tmdb.org/t/p/w500/xGz75oFXt4OmFgvQ7kVjaPboRJr.jpg'),(7019,601,'E.T. the Extra-Terrestrial','After a gentle alien becomes stranded on Earth, the being is discovered and befriended by a young boy named Elliott. Bringing the extraterrestrial into his suburban California house, Elliott introduces E.T., as the alien is dubbed, to his brother and his little sister, Gertie, and the children decide to keep its existence a secret. Soon, however, E.T. falls ill, resulting in government intervention and a dire situation for both Elliott and the alien.',894,115,'Science Fiction',1982,7.5,'https://image.tmdb.org/t/p/w500/cNlhcOAjJZmvI20G08wdnvxs0EK.jpg'),(7020,82703,'Mr. Peabody & Sherman','A young boy and his dog, who happens to have a genius-level IQ, spring into action when their time-machine is stolen and moments in history begin to be changed.',898,92,'Animation',2014,6.7,'https://image.tmdb.org/t/p/w500/zfM3kcF6IiHkM84JsMFYAnKnEuh.jpg'),(7021,81,'Nausicaä of the Valley of the Wind','After a global war, the seaside kingdom known as the Valley of the Wind remains one of the last strongholds on Earth untouched by a poisonous jungle and the powerful insects that guard it. Led by the courageous Princess Nausicaä, the people of the Valley engage in an epic struggle to restore the bond between humanity and Earth.',156,117,'Adventure',1984,7.9,'https://image.tmdb.org/t/p/w500/sIpcATxMrKHRRUJAGI5UIUT7XMG.jpg'),(7022,8587,'The Lion King','A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?',905,89,'Family',1994,8.3,'https://image.tmdb.org/t/p/w500/sKCr78MXSLixwmZ8DyJLrpMsd15.jpg'),(7023,10527,'Madagascar: Escape 2 Africa','Alex, Marty, and other zoo animals find a way to escape from Madagascar when the penguins reassemble a wrecked airplane. The precariously repaired craft stays airborne just long enough to make it to the African continent. There the New Yorkers encounter members of their own species for the first time. Africa proves to be a wild place, but Alex and company wonder if it is better than their Central Park home.',908,89,'Family',2008,6.4,'https://image.tmdb.org/t/p/w500/9lfNdHVfd37R1GszeH5ZcWzkb14.jpg'),(7024,11224,'Cinderella','Cinderella has faith her dreams of a better life will come true. With help from her loyal mice friends and a wave of her Fairy Godmother\'s wand, Cinderella\'s rags are magically turned into a glorious gown and off she goes to the Royal Ball. But when the clock strikes midnight, the spell is broken, leaving a single glass slipper... the only key to the ultimate fairy-tale ending!',912,74,'Family',1950,7,'https://image.tmdb.org/t/p/w500/avz6S9HYWs4O8Oe4PenBFNX4uDi.jpg'),(7025,10603,'George of the Jungle','After Baby George survives a plane crash in the jungle, he is rescued and then adopted by a wise ape. Years later, grown-up George saves a US noble woman, Ursula Stanhope while she is on a safari—and takes her to the jungle to live with him. While Ursula\'s lover continues his search for Ursula and the one who took her, George slowly learns the rules of human relationships.',915,92,'Adventure',1997,5.4,'https://image.tmdb.org/t/p/w500/3ezRDeK5RGvsq1Yui0tYVQhxDdu.jpg'),(7026,14128,'Cinderella II: Dreams Come True','As a newly crowned princess, Cinderella quickly learns that life at the Palace - and her royal responsibilities - are more challenging than she had imagined. In three heartwarming tales, Cinderella calls on her animal friends and her Fairy Godmother to help as she brings her own grace and charm to her regal role and discovers that being true to yourself is the best way to make your dreams come true.',918,74,'Family',2002,5.9,'https://image.tmdb.org/t/p/w500/gmyZ10NuMrQ5FZHXsqVpRQJ5JPy.jpg'),(7027,506574,'Descendants 3','The teenagers of Disney\'s most infamous villains return to the Isle of the Lost to recruit a new batch of villainous offspring to join them at Auradon Prep.',921,106,'Family',2019,7.9,'https://image.tmdb.org/t/p/w500/7IRy0iHdaS0JI3ng4ZYlk5gLSFn.jpg'),(7028,400650,'Mary Poppins Returns','In Depression-era London, a now-grown Jane and Michael Banks, along with Michael\'s three children, are visited by the enigmatic Mary Poppins following a personal loss. Through her unique magical skills, and with the aid of her friend Jack, she helps the family rediscover the joy and wonder missing in their lives.',925,131,'Fantasy',2018,6.5,'https://image.tmdb.org/t/p/w500/uTVGku4LibMGyKgQvjBtv3OYfAX.jpg'),(7029,9732,'The Lion King II: Simba\'s Pride','The circle of life continues for Simba, now fully grown and in his rightful place as the king of Pride Rock. Simba and Nala have given birth to a daughter, Kiara who\'s as rebellious as her father was. But Kiara drives her parents to distraction when she catches the eye of Kovu, the son of the evil lioness, Zira. Will Kovu steal Kiara\'s heart?',928,81,'Adventure',1998,6.9,'https://image.tmdb.org/t/p/w500/9jnskwVz92bOikkKlh0e9QaLLA6.jpg'),(7960,95,'Armageddon','When an asteroid threatens to collide with Earth, NASA honcho Dan Truman determines the only way to stop it is to drill into its surface and detonate a nuclear bomb. This leads him to renowned driller Harry Stamper, who agrees to helm the dangerous space mission provided he can bring along his own hotshot crew. Among them is the cocksure A.J. who Harry thinks isn\'t good enough for his daughter, until the mission proves otherwise.',970,151,'Action',1998,6.7,'https://image.tmdb.org/t/p/w500/fMtOCd0EAdAzKtGLQiHjSUvbdNc.jpg'),(7961,568,'Apollo 13','The true story of technical troubles that scuttle the Apollo 13 lunar mission in 1970, risking the lives of astronaut Jim Lovell and his crew, with the failed journey turning into a thrilling saga of heroism. Drifting more than 200,000 miles from Earth, the astronauts work furiously with the ground crew to avert tragedy.',219,140,'Drama',1995,7.4,'https://image.tmdb.org/t/p/w500/oYUZHYMwNKnE1ef4WE5Hw2a9OAY.jpg'),(7962,2067,'Mission to Mars','When contact is lost with the crew of the first Mars expedition, a rescue mission is launched to discover their fate.',974,114,'Science Fiction',2000,5.9,'https://image.tmdb.org/t/p/w500/beDWEWxgFlt1UWvf2al9cjDol2i.jpg'),(7963,2103,'Solaris','A troubled psychologist is sent to investigate the crew of an isolated research station orbiting a bizarre planet.',977,99,'Drama',2002,5.9,'https://image.tmdb.org/t/p/w500/o839RFIxPrpgOMKQ21SOQl4908t.jpg'),(7964,395992,'Life','The six-member crew of the International Space Station is tasked with studying a sample from Mars that may be the first proof of extra-terrestrial life, which proves more intelligent than ever expected.',981,103,'Horror',2017,6.4,'https://image.tmdb.org/t/p/w500/pNM3ASsU1IrN0SgGOBldHQ53iSb.jpg'),(7965,10734,'Escape from Alcatraz','Escape from Alcatraz tells the story of the only three men ever to escape from the infamous maximum security prison at Alcatraz. In 29 years, the seemingly impenetrable federal penitentiary, which housed Al Capone and \"Birdman\" Robert Stroud, was only broken once - by three men never heard of again.',982,111,'Crime',1979,7.5,'https://image.tmdb.org/t/p/w500/fEXxILY3zm8821sEMSHrD1rjMe.jpg'),(7966,9549,'The Right Stuff','A chronicle of the original Mercury astronauts in the formation of America\'s space program: Alan Shepherd, the first American in space; Gus Grissom, the benighted astronaut for whom nothing works out as planned; John Glenn, the straight-arrow \'boy scout\' of the bunch who was the first American to orbit the earth; and the remaining pilots: Deke Slayton, Scott Carpenter and Wally Schirra.',986,193,'Drama',1983,7.5,'https://image.tmdb.org/t/p/w500/btqTjNRxecYgQ1FGfVlLqSSNjz.jpg'),(7967,27066,'The Voyeur','At a college in Rome, a professor, nicknamed \"Dodo\" is in a deep depression. His stunningly beautiful wife has just left him for another man. Dodo wants her back very badly and has erotic daydreams about her. A beautiful young student in his class asks him for a ride home and seduces the lucky man, but still he wonders about his wife and her lover.',989,90,'Drama',1994,4.5,'https://image.tmdb.org/t/p/w500/9gxEUC0wMw1eo8untipmOH17h48.jpg'),(7968,8077,'Alien³','After escaping with Newt and Hicks from the alien planet, Ripley crash lands on Fiorina 161, a prison planet and host to a correctional facility. Unfortunately, although Newt and Hicks do not survive the crash, a more unwelcome visitor does. The prison does not allow weapons of any kind, and with aid being a long time away, the prisoners must simply survive in any way they can.',58,114,'Science Fiction',1992,6.3,'https://image.tmdb.org/t/p/w500/hlabk6APJUeihZDaSD9N6iI0f4g.jpg'),(7969,54138,'Star Trek Into Darkness','When the crew of the Enterprise is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis.  With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction. As our heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.',278,132,'Action',2013,7.3,'https://image.tmdb.org/t/p/w500/7XrRkhMa9lQ71RszzSyVrJVvhyS.jpg'),(7970,330459,'Rogue One: A Star Wars Story','A rogue band of resistance fighters unite for a mission to steal the Death Star plans and bring a new hope to the galaxy.',996,133,'Action',2016,7.5,'https://image.tmdb.org/t/p/w500/5jX3p0apUG5bkMHtnKZch0xpkBS.jpg'),(7971,7453,'The Hitchhiker\'s Guide to the Galaxy','Mere seconds before the Earth is to be demolished by an alien construction crew, Arthur Dent is swept off the planet by his friend Ford Prefect, a researcher penning a new edition of \"The Hitchhiker\'s Guide to the Galaxy.\"',999,109,'Adventure',2005,6.7,'https://image.tmdb.org/t/p/w500/8xcE5CjWaXfKWM0oNlCPPFv3ZYJ.jpg'),(7972,11864,'Enemy Mine','A soldier from Earth crashlands on an alien world after sustaining battle damage. Eventually he encounters another survivor, but from the enemy species he was fighting; they band together to survive on this hostile world. In the end the human finds himself caring for his enemy in a completely unexpected way.',585,108,'Drama',1985,6.8,'https://image.tmdb.org/t/p/w500/a3dr9L8VIjhEvivzQ2M12VQDere.jpg'),(7973,274870,'Passengers','A spacecraft traveling to a distant colony planet and transporting thousands of people has a malfunction in its sleep chambers. As a result, two passengers are awakened 90 years early.',1004,116,'Drama',2016,6.9,'https://image.tmdb.org/t/p/w500/n5DpXC4ZxH4dnydcz7qav9iA4U.jpg'),(7974,679,'Aliens','When Ripley\'s lifepod is found by a salvage crew over 50 years later, she finds that terra-formers are on the very planet they found the alien species. When the company sends a family of colonists out to investigate her story—all contact is lost with the planet and colonists. They enlist Ripley and the colonial marines to return and search for answers.',160,137,'Action',1986,7.9,'https://image.tmdb.org/t/p/w500/xwdPTZyyBa4U3V2N0EmozTCeEAY.jpg');
