INSERT INTO `TvShows` VALUES (69,4386,'Baywatch','The thrilling adventures of the iconic Los Angeles County Lifeguards as they patrol the beautiful beaches of Southern California.',241,42,'Action & Adventure',1989,5.5,'https://image.tmdb.org/t/p/w500/34t8WxHn1OcIVpcTxmjYmjX9tE4.jpg'),(318,60625,'Rick and Morty','Rick is a mentally-unbalanced but scientifically-gifted old man who has recently reconnected with his family. He spends most of his time involving his young grandson Morty in dangerous, outlandish adventures throughout space and alternate universes. Compounded with Morty\'s already unstable family life, these events cause Morty much distress at home and school.',245,22,'Animation',2013,8.7,'https://image.tmdb.org/t/p/w500/8kOWDBK6XlPUzckuHDo3wwVRFwt.jpg'),(378,5920,'The Mentalist','Patrick Jane, a former celebrity psychic medium, uses his razor sharp skills of observation and expertise at \"reading\" people to solve serious crimes with the California Bureau of Investigation.',249,43,'Drama',2008,8,'https://image.tmdb.org/t/p/w500/acYXu4KaDj1NIkMgObnhe4C4a0T.jpg'),(531,1405,'Dexter','Dexter Morgan, a blood spatter pattern analyst for the Miami Metro Police also leads a secret life as a serial killer, hunting down criminals who have slipped through the cracks of justice.',253,50,'Crime',2006,8,'https://image.tmdb.org/t/p/w500/p4rx3FW14Ayx1dLHJQBqDGw9YiX.jpg'),(656,2190,'South Park','Follows the misadventures of four irreverent grade-schoolers in the quiet, dysfunctional town of South Park, Colorado.',257,22,'Comedy',1997,8,'https://image.tmdb.org/t/p/w500/9BvRze9keEyTzB6ewmDvjzFGYuG.jpg'),(997,2316,'The Office','The everyday lives of office employees in the Scranton, Pennsylvania branch of the fictional Dunder Mifflin Paper Company.',260,20,'Comedy',2005,8.3,'https://image.tmdb.org/t/p/w500/qWnJzyZhyy74gjpSjIXWmuk0ifX.jpg'),(1211,1911,'Bones','Dr. Temperance Brennan and her colleagues at the Jeffersonian\'s Medico-Legal Lab assist Special Agent Seeley Booth with murder investigations when the remains are so badly decomposed, burned or destroyed that the standard identification methods are useless.',264,40,'Crime',2005,7.8,'https://image.tmdb.org/t/p/w500/1bwF1daWnsEYYjbHXiEMdS587fR.jpg'),(1459,62710,'Blindspot','A vast international plot explodes when a beautiful Jane Doe is discovered naked in Times Square, completely covered in mysterious, intricate tattoos with no memory of who she is or how she got there. But there\'s one tattoo that is impossible to miss: the name of FBI agent Kurt Weller, emblazoned across her back. \"Jane,\" Agent Weller and the rest of the FBI quickly realize that each mark on her body is a crime to solve, leading them closer to the truth about her identity and the mysteries to be revealed.',268,43,'Action',2015,6.8,'https://image.tmdb.org/t/p/w500/iAkEexatzMUlCXlbS8Gmvlic9gQ.jpg'),(1552,44217,'Vikings','The adventures of Ragnar Lothbrok, the greatest hero of his age. The series tells the sagas of Ragnar\'s band of Viking brothers and his family, as he rises to become King of the Viking tribes. As well as being a fearless warrior, Ragnar embodies the Norse traditions of devotion to the gods. Legend has it that he was a direct descendant of Odin, the god of war and warriors.',272,44,'Action & Adventure',2013,7.7,'https://image.tmdb.org/t/p/w500/ff1zhqvwfS5HvRNcA5UFrH0PA2q.jpg'),(1638,40075,'Gravity Falls','Twin brother and sister Dipper and Mabel Pines are in for an unexpected adventure when they spend the summer helping their great uncle Stan run a tourist trap in the mysterious town of Gravity Falls, Oregon.',276,22,'Animation',2012,8.3,'https://image.tmdb.org/t/p/w500/9NdarEMp4xAW690GHtwSbxcl1T7.jpg'),(1739,4607,'Lost','Stripped of everything, the survivors of a horrific plane crash  must work together to stay alive. But the island holds many secrets.',278,45,'Action & Adventure',2004,7.8,'https://image.tmdb.org/t/p/w500/yhS5dwYwqiMYQ6C6tO8uDaNjC1Z.jpg'),(1888,615,'Futurama','The adventures of a late-20th-century New York City pizza delivery boy, Philip J. Fry, who, after being unwittingly cryogenically frozen for one thousand years, finds employment at Planet Express, an interplanetary delivery company in the retro-futuristic 31st century.',282,22,'Animation',1999,8.2,'https://image.tmdb.org/t/p/w500/eyvvM4NCK7N6WAS9vxfHPpVwia1.jpg'),(2018,1920,'Twin Peaks','The body of Laura Palmer is washed up on a beach near the small Washington state town of Twin Peaks. FBI Special Agent Dale Cooper is called in to investigate her strange demise only to uncover a web of mystery that ultimately leads him deep into the heart of the surrounding woodland and his very own soul.',286,46,'Drama',1990,8.2,'https://image.tmdb.org/t/p/w500/ypeuD2LJiHSotbwy5C7wFeZSBhv.jpg'),(2135,66788,'13 Reasons Why','After a teenage girl\'s perplexing suicide, a classmate receives a series of tapes that unravel the mystery of her tragic choice.',288,57,'Drama',2017,7.5,'https://image.tmdb.org/t/p/w500/nel144y4dIOdFFid6twN5mAX9Yd.jpg'),(2248,4586,'Gilmore Girls','Set in the charming town of Stars Hollow, Connecticut, the series follows the captivating lives of Lorelai and Rory Gilmore, a mother/daughter pair who have a relationship most people only dream of.',477,44,'Comedy',2000,7.7,'https://image.tmdb.org/t/p/w500/dSS7XoqmNxMebyVbEGBY0HWrReA.jpg'),(2440,46786,'Bates Motel','A \"contemporary prequel\" to the 1960 film Psycho, depicting the life of Norman Bates and his mother Norma prior to the events portrayed in Hitchcock\'s film, albeit in a different fictional town and in a modern setting. The series begins after the death of Norma\'s husband, when she purchases a motel located in a coastal Oregon town so she and Norman can start a new life.',481,43,'Mystery',2013,7.9,'https://image.tmdb.org/t/p/w500/xXKcfZE7ulYxgjjYv51s0zDG69s.jpg'),(2492,46648,'True Detective','An American anthology police detective series utilizing multiple timelines in which investigations seem to unearth personal and professional secrets of those involved, both within or outside the law.',485,60,'Drama',2014,8.3,'https://image.tmdb.org/t/p/w500/aowr4xpLP5sRCL50TkuADomJ98T.jpg'),(2516,69050,'Riverdale','Set in the present, the series offers a bold, subversive take on Archie, Betty, Veronica and their friends, exploring the surreality of small-town life, the darkness and weirdness bubbling beneath Riverdale’s wholesome facade.',488,45,'Drama',2017,8.4,'https://image.tmdb.org/t/p/w500/4X7o1ssOEvp4BFLim1AZmPNcYbU.jpg'),(2592,66292,'Big Little Lies','The tale of three mothers of first graders whose apparently perfect lives unravel to the point of murder.',491,50,'Drama',2017,7.7,'https://image.tmdb.org/t/p/w500/zxGkno93ExrTMsJVllH6mzQ652z.jpg'),(2606,31917,'Pretty Little Liars','Based on the Pretty Little Liars series of young adult novels by Sara Shepard, the series follows the lives of four girls — Spencer, Hanna, Aria, and Emily — whose clique falls apart after the disappearance of their queen bee, Alison. One year later, they begin receiving messages from someone using the name \"A\" who threatens to expose their secrets — including long-hidden ones they thought only Alison knew.',495,41,'Drama',2010,7.2,'https://image.tmdb.org/t/p/w500/aUPbHiLS3hCHKjtLsncFa9g0viV.jpg'),(2778,77826,'SKAM Italia','',NULL,22,'Drama',2018,8.1,'https://image.tmdb.org/t/p/w500/uh4GdIawyWF9Nhpyo24OjPWLCJm.jpg'),(2820,92867,'Projet 2000','',NULL,0,'Unknown',2020,0,'https://image.tmdb.org/t/p/w500/zADMDHqmpDVUPeW5FQGU1nVTJX5.jpg'),(2829,72884,'Jérémie','This summer, Jérémie is determined to mojo back! Haunted by a painful secret, the young woman finds refuge in a new job at the Domaine du Lac beach along with five lifeguards: Raphaëlle, Camille, Olivier, Thomas and Maxim. What better way to forget your troubles than partying in the sun?',502,23,'Drama',2015,10,'https://image.tmdb.org/t/p/w500/ypMIRwxCAY7ZZj8dlen9cD5upG3.jpg'),(2920,3716,'Dragnet','Dragnet is a radio, television and motion picture series, enacting the cases of a dedicated Los Angeles police detective, Sergeant Joe Friday, and his partners. The show takes its name from the police term \"dragnet\", meaning a system of coordinated measures for apprehending criminals or suspects.',506,30,'Drama',1951,6.7,'https://image.tmdb.org/t/p/w500/393BVqnVaioYBE5f3LMUwFRAwPQ.jpg'),(3195,2813,'Mannix','Mannix is an American television detective series that ran from 1967 through 1975 on CBS. Created by Richard Levinson and William Link and developed by executive producer Bruce Geller, the title character, Joe Mannix, is a private investigator. He is played by Mike Connors. Mannix was the last series produced by Desilu Productions.',509,60,'Drama',1967,7.2,'https://image.tmdb.org/t/p/w500/ucKAcYsLIGSV3lRUEodrVOE1pXX.jpg'),(3389,5375,'Emergency!','Emergency! is an American television series that combines the medical drama and action-adventure genres. It was produced by Mark VII Limited and distributed by Universal Studios. It debuted as a midseason replacement on January 15, 1972, on NBC, replacing the two short-lived series The Partners and The Good Life, and ran until May 28, 1977, with six additional two-hour television films during the following two years. Emergency! was created and produced by Jack Webb and Robert A. Cinader, both of whom were also responsible for the police dramas Adam-12 and Dragnet.',506,60,'Action & Adventure',1972,8,'https://image.tmdb.org/t/p/w500/4rhElt5IoQPccbmp70IH6Hvqy3J.jpg'),(3523,67116,'Lethal Weapon','A slightly unhinged former Navy SEAL lands a job as a police officer in Los Angeles where he\'s partnered with a veteran detective trying to keep maintain a low stress level in his life.',516,43,'Action & Adventure',2016,7.2,'https://image.tmdb.org/t/p/w500/jbMZkxLHVDSKiZh0HppCthRW96k.jpg'),(3578,53606,'Love','Rebellious Mickey and good-natured Gus navigate the thrills and agonies of modern relationships.',520,32,'Comedy',2016,7.5,'https://image.tmdb.org/t/p/w500/9K3feXx0XnbCZPidkbdOAllhj2u.jpg'),(3612,4177,'Perry Mason','The cases of master criminal defense attorney Perry Mason and his staff who handled the most difficult of cases in the aid of the innocent.',524,60,'Mystery',1957,8.1,'https://image.tmdb.org/t/p/w500/uoQh6JAYUYWVw4P99DV5HgKGNmI.jpg'),(3923,5917,'90210','90210 revolves around several students at the fictional West Beverly Hills High School, including new Beverly Hills residents Annie Wilson and Dixon Wilson. Their father, Harry Wilson, has returned from Kansas to his Beverly Hills childhood home with his family to care for his mother, former television and theater actress Tabitha Wilson, who has a drinking problem and clashes with his wife Debbie Wilson. Annie and Dixon struggle to adjust to their new lives while making friends and yet adhering to their parents\' wishes.',528,40,'Drama',2008,5.2,'https://image.tmdb.org/t/p/w500/w7LPiP7rWb8anQp3z23NblLyL32.jpg'),(4065,326,'Red Dwarf','The adventures of the last human alive and his friends, stranded three million years into deep space on the mining ship Red Dwarf.',602,30,'Comedy',1988,8.2,'https://image.tmdb.org/t/p/w500/dAaVWMhCCrSuimSETs9Z5ZTZQ3v.jpg'),(4165,1434,'Family Guy','Sick, twisted, politically incorrect and Freakin\' Sweet animated series featuring the adventures of the dysfunctional Griffin family. Bumbling Peter and long-suffering Lois have three kids. Stewie (a brilliant but sadistic baby bent on killing his mother and taking over the world), Meg (the oldest, and is the most unpopular girl in town) and Chris (the middle kid, he\'s not very bright but has a passion for movies). The final member of the family is Brian - a talking dog and much more than a pet, he keeps Stewie in check whilst sipping Martinis and sorting through his own life issues.',606,22,'Animation',1999,6.6,'https://image.tmdb.org/t/p/w500/q3E71oY6qgAEiw6YZIHDlHSLwer.jpg'),(4534,5895,'FLCL','Naota is a normal Japanese 6th grade boy although a little cynical. When his older brother leaves for America to play baseball, his brother leaves his 17 year old girlfriend Mamimi behind. Mamimi is sending mixed signals and make advances on Naota, and he doesn\'t know what to do about her. But to make matters worse, Naota\'s world is totally turned upside down when he is run over by a woman on a Vespa. During their first encounter, she hits him over the head with her guitar, which then causes a horn to grow out of his forehead. She calls herself \"Haruko\" and her presence changes Naota\'s life to even further insanity.',609,25,'Comedy',2000,7.8,'https://image.tmdb.org/t/p/w500/FkgA8CcmiLJGVCRYRQ2g2UfVtF.jpg'),(4565,2290,'Stargate Atlantis','With the Ancients\' city of Atlantis discovered in the Pegasus Galaxy by Stargate Command, Dr. Elizabeth Weir and Major Sheppard lead a scientific expedition to the ancient abandoned city. Once there, the team not only find themselves unable to contact Earth, but their explorations unexpectedly reawaken the Ancients\' deadly enemies, The Wraith, who hunger for this new prey. Now with the help of newfound local allies like Teyla Emmagan, the Atlantis Team sets about to uncover their new home\'s secrets even as their war of survival against the Wraith begins.',613,45,'Action & Adventure',2004,7.9,'https://image.tmdb.org/t/p/w500/zfFjkOSK18SVrFRvvwrMrt6bEPy.jpg'),(4667,2418,'The Venture Bros.','Hank and Dean Venture, with their father Doctor Venture and faithful bodyguard Brock Samson, go on wild adventures facing megalomaniacs, zombies, and suspicious ninjas, all for the glory of adventure. Or something like that.',617,30,'Animation',2004,8,'https://image.tmdb.org/t/p/w500/7LNwuFtB2xi3QaLxVXVe4gF4eXn.jpg'),(4755,5148,'Stargate Universe','The adventures of a present-day, multinational exploration team traveling on the Ancient spaceship Destiny many billions of light years distant from the Milky Way Galaxy. They evacuated there and are now trying to figure out a way to return to Earth, while simultaneously trying to explore and to survive in their unknown area of the universe.',613,45,'Action & Adventure',2009,7.2,'https://image.tmdb.org/t/p/w500/nq9ga7YkixdXx0QgDEJ0U19bSR8.jpg'),(4831,4271,'Farscape','A freak accident during an experimental space mission catapults Astronaut John Crichton across a thousand galaxies to an alien battlefield.',623,60,'Action & Adventure',1999,7.9,'https://image.tmdb.org/t/p/w500/fCJx7cCXKOEkmCVIIyP8qk0Pb7Y.jpg'),(5003,2996,'The Office','Documentary-style sitcom sets in the offices of a Slough paper merchant.',260,30,'Comedy',2001,8,'https://image.tmdb.org/t/p/w500/orzJbkbocfSz9D1SY9H8Rhh8a27.jpg'),(5024,57815,'Ground Floor','Brody, a young hot-shot banker at Whitestone Trust, thought he was just having a one-night stand with Jennifer, a beautiful woman he met at a bar. But when he discovers that she works in maintenance for the building where he works, their worlds begin to collide in the most unexpected way. Facing Brody’s critical boss, Mr. Mansfield, as well as annoyed colleagues, the pair must find a way to deal with their growing feelings for each other in this modern take on Romeo & Juliet.',628,20,'Comedy',2013,7.1,'https://image.tmdb.org/t/p/w500/hBrz4xVktQhAq4bwfnXNrVO2AN1.jpg'),(5044,70633,'The Office','Finnish adaption of the British TV series \"The Office\".',NULL,22,'Comedy',2017,0,'https://image.tmdb.org/t/p/w500/gXRVl5vnlvy3erURyKXd0ZsoZtt.jpg'),(5070,40110,'Trollied','Set in Valco, a fictional budget supermarket in the north west of England, Trollied finds the funny in one of our most familiar surroundings and focuses on the types of characters we all recognise: bored checkout staff, ineffectual managers and a range of customers, from the irate to the downright bizarre.',635,23,'Comedy',2011,6.1,'https://image.tmdb.org/t/p/w500/zeHIRsQXtTSqPQ3ya16ACwmPCL6.jpg'),(5141,46831,'Government Job','The backbone of the \"Drzavni Posao (Government Job)\" are satirical talks between the three actors, the comments are reminiscent of the \"stand-up\" form. These are short, witty comments and observations on daily life, circumstances, sociopolitical situation, sports, entertainment world, their personal opinions on various topics. The main idea is to present day in a non-existent government company and three employees of thinking about daily events in it, but also about life and society in general. Topics drawn from the daily and weekly press, for various blogs, websites, talk about movies, series, shows - radio and television. The idea is that actors humorously comment on current events, to laugh viewers and encourage them to think about them.',639,10,'Comedy',2012,8.7,'https://image.tmdb.org/t/p/w500/sceVlRK5RvnU1qjNipyWDHQXB7x.jpg'),(5533,2490,'The IT Crowd','UK Comedy series about two I.T. nerds and their clueless female manager, who work in the basement of a very successful company. When they are called on for help, they are never treated with any respect at all.',642,22,'Comedy',2006,8.2,'https://image.tmdb.org/t/p/w500/1R550Xt4HpGCMr7HitsbFlRcAUS.jpg'),(5565,8592,'Parks and Recreation','Hilarious ensemble comedy that follows Leslie Knope, a mid-level bureaucrat in the Parks and Recreation Department of Pawnee, Indiana, and her tireless efforts to make her quintessentially American town just a little bit more fun.',646,22,'Comedy',2009,8,'https://image.tmdb.org/t/p/w500/spuesthssmjABJUPYWJ7i1fuz8g.jpg'),(5695,62649,'Superstore','A hilarious workplace comedy about a unique family of employees at a super-sized mega store. From the bright-eyed newbies and the seen-it-all veterans to the clueless summer hires and the in-it-for-life managers, together they hilariously tackle the day-to-day grind of rabid bargain hunters, riot-causing sales and nap-worthy training sessions.',649,22,'Comedy',2015,7.2,'https://image.tmdb.org/t/p/w500/2tpY5qIYwH85njvjI5BnH4VNA6p.jpg'),(5826,37664,'The Secret Circle','After her mother dies in a fire, Cassie Blake moves in with her grandmother in the small town of Chance Harbor, Washington. As she gets to know her high school classmates, strange and frightening things begin to happen. They are all descended from powerful witches, and they\'ve been waiting for Cassie to join them and complete a new generation of the Secret Circle. What they don\'t yet know is that darker powers are at play and that Cassie\'s mother\'s death might not have been an accident.',763,42,'Drama',2011,7.2,'https://image.tmdb.org/t/p/w500/3MwvNMhD9xpf1exlSfWgVm4sOF5.jpg'),(5849,80743,'Insatiable','A bullied teenager turns to beauty pageants as a way to exact her revenge, with the help of a disgraced coach who soon realizes he\'s in over his head.',766,45,'Drama',2018,7.9,'https://image.tmdb.org/t/p/w500/lHZ4xqGQlmyiFTOVtwnNpTcZgkd.jpg'),(5871,39859,'Awkward.','An irreverent look at the conflict, chaos and humor that defines teenage life through the eyes of 15-year-old Jenna Hamilton whose life begins to change when a simple accident becomes an epic misunderstanding and is blown way out of proportion. Narration in the first-person voice of Jenna\'s blog posts captures the humor within the struggles and experiences everyone can relate to from their formative years.',770,22,'Comedy',2011,7,'https://image.tmdb.org/t/p/w500/hXbaaDDnTtj82TeR8pKQF5MriDS.jpg'),(5970,4624,'Roswell','Bizarre things start happening in the little New Mexico town where UFOs were spotted in 1947. Cut to 1999, when a cute high-school student saves the life of a teenage waitress. Surrounded by cliques of clever, angst-filled classmates, the two form a bond that threatens the survival of a secret universe involving superhuman powers, a yen for hot sauce and an alien gene pool.',774,60,'Drama',1999,7.7,'https://image.tmdb.org/t/p/w500/k1fHjj1TGPdP4tQfNlU74ibOmT4.jpg'),(6042,1395,'Gossip Girl','An exclusive group of privileged teens from a posh prep school on Manhattan\'s Upper East Side whose lives revolve around the blog of the all-knowing albeit ultra-secretive Gossip Girl.',777,42,'Comedy',2008,7.7,'https://image.tmdb.org/t/p/w500/mRvSUuU1VQQkZZ578jKJpcUCuL8.jpg'),(6180,63210,'Shadowhunters','When Clary Fray\'s mother has disappeared, Clary joins a band of Shadowhunters; demon killing hunters, and gets caught up in a plan to save the world.',780,42,'Action & Adventure',2016,7.3,'https://image.tmdb.org/t/p/w500/66YHvvVduC21xcMXPpBBF0ywyVZ.jpg'),(6238,4500,'The Wonder Years','The Wonder Years tells the story of Kevin Arnold (Fred Savage) facing the trials and tribulations of youth while growing up during the 1960s and 70s. Told through narration from an adult Kevin (Daniel Stern), Kevin faces the difficulties of maintaining relationships and friendships on his enthralling journey into adulthood.',784,24,'Comedy',1988,8,'https://image.tmdb.org/t/p/w500/tkaduqdhFrF1vp8L55OJfB5jw8Z.jpg'),(6406,65320,'Skam','The story of a young teenager group, born 1999, and a pupil on Hartvig Nissens upper secondary school in Oslo, and her friends and their life, troubles, scandals and every day life. Which of the members represented changes per season.',788,25,'Comedy',2015,7.4,'https://image.tmdb.org/t/p/w500/89oewcrhN9fixEXxTWgL9X2TUGS.jpg'),(6449,1948,'Degrassi','The life of a group of adolescents going through the trials and tribulations of teendom at Degrassi Community School.',792,22,'Drama',2001,7.3,'https://image.tmdb.org/t/p/w500/bDmfJRxZqwT1XvPQZCgooFWSyHF.jpg'),(6831,2808,'Totally Spies!','Totally Spies! depicts three girlfriends \'with an attitude\' who have to cope with their daily lives at high school as well as the unpredictable pressures of international espionage. They confront the most intimidating - and demented - of villains, each with their own special agenda for demonic, global rude behavior.',796,22,'Animation',2001,6.6,'https://image.tmdb.org/t/p/w500/zvEit6c2zC2PosXROb85jZwb0gx.jpg'),(7030,73602,'Greenhouse Academy','When teen siblings Hayley and Alex enter an elite boarding school, they find rivalry, romance and a mystery related to the recent loss of their mom.',930,30,'Drama',2017,7.7,'https://image.tmdb.org/t/p/w500/2pmRIz7Dc2cmwZUQiOsStOixyvZ.jpg'),(7070,1431,'CSI: Crime Scene Investigation','A Las Vegas team of forensic investigators are trained to solve criminal cases by scouring the crime scene, collecting irrefutable evidence and finding the missing pieces that solve the mystery.',934,45,'Crime',2000,7.2,'https://image.tmdb.org/t/p/w500/t6hnMaWMuX2brNL6Dq52dDLxZMt.jpg'),(7406,42025,'Mako Mermaids: An H2O Adventure','Real-life mermaids, Sirena, Nixie and Lyla are part of a mermaid pod, which lives in the waters of Mako Island. As young members of the pod, it is their job to protect the Moon Pool and guard it from trespassers. But on the night of a full moon, the mischievous mermaid girls neglect their duties. Sixteen-year-old land-dweller Zac enters the Moon Pool and forms a special connection with Mako.\n\nZac is given a fish-like tail and amazing powers. The mermaid pod is forced to leave Mako, leaving behind the three mermaid girls, cast out of the pod. They know there\'s only one way they will be allowed to rejoin the pod: They must get legs, venture onto land and take back Zac\'s powers – or risk being outcasts forever.',938,30,'Comedy',2013,8.2,'https://image.tmdb.org/t/p/w500/9auRrJCBsjREx57wU8lBwLRafO9.jpg'),(7474,19614,'It','In 1960, seven outcast kids known as \"The Losers\' Club\" fight an evil demon who poses as a child-killing clown. Thirty years later, they reunite to stop the demon once and for all when it returns to their hometown.',942,180,'Mystery',1990,6.6,'https://image.tmdb.org/t/p/w500/o3uwaF1zmarUiGYiIDY0OKZ4gdp.jpg'),(7476,41956,'Death in Paradise','Detective Inspector Richard Poole is transferred to Sainte Marie, an island in the Caribbean. Totally unsuited to the Caribbean way of life, Richard hates the sun, sea and sand and isn\'t used to the Sainte Marie style of policing. Working with the exotic Camille each week Richard investigates intricate and intriguing murders.',946,60,'Comedy',2011,7.5,'https://image.tmdb.org/t/p/w500/lFvpF2V0xkiSdAVAViVqqEeeCt9.jpg'),(7548,90,'Mayday','Revealing the dark truth that aviation safety improves one crash at a time, Mayday  investigates legendary aviation disasters to find out what went wrong and why.\n\nBased on cockpit voice recorders, accident reports and eyewitness accounts, every episode also features interviews, state-of-the-art CGI and gripping reenactments.',950,45,'Documentary',2003,8,'https://image.tmdb.org/t/p/w500/4HltSRp1bUf5Ca56tTv9fSuJqaE.jpg'),(7759,60622,'Fargo','A close-knit anthology series dealing with stories involving malice, violence and murder based in and around Minnesota.',952,43,'Crime',2014,8.3,'https://image.tmdb.org/t/p/w500/e890UetS6XH7kqltlZ8VU6qDaHU.jpg'),(7792,19885,'Sherlock','A modern update finds the famous sleuth and his doctor partner solving crime in 21st century London.',955,90,'Crime',2010,8.4,'https://image.tmdb.org/t/p/w500/aguWVR8xNilvw7t4X03UvG1hRJr.jpg'),(7813,34415,'The Killing','The Killing is an American crime drama television series based upon the Danish television series Forbrydelsen. Set in Seattle, Washington, the series follows the various murder investigations by homicide detectives Sarah Linden and Stephen Holder.',958,59,'Drama',2011,7.8,'https://image.tmdb.org/t/p/w500/hIeyo0kkG7uJ05c0AGFhhEAJRba.jpg'),(7861,65249,'ERASED','Satoru Fujinuma is a struggling manga artist who has the ability to turn back time and prevent deaths. When his mother is killed he turns back time to solve the mystery, but ends up back in elementary school, just before the disappearance of his classmate Kayo.',961,25,'Animation',2016,8.1,'https://image.tmdb.org/t/p/w500/1HQp3xrmfCQMpCwVu2fo8tEji2j.jpg'),(7874,873,'Columbo','Columbo is a friendly, verbose, disheveled-looking police detective who is consistently underestimated by his suspects. Despite his unprepossessing appearance and apparent absentmindedness, he shrewdly solves all of his cases and secures all evidence needed for indictment. His formidable eye for detail and meticulously dedicated approach often become clear to the killer only late in the storyline.',964,75,'Crime',1971,8,'https://image.tmdb.org/t/p/w500/2JCD8vab3fircOU8cM2HJCxfv4I.jpg'),(7943,49010,'The Fall','When the Police Service of Northern Ireland are unable to close a case after 28 days, Detective Superintendent Stella Gibson of the Metropolitan Police Service is called in to review the case. Under her new leadership, the local detectives must track down and stop a serial killer who is terrorising the city of Belfast.',966,57,'Drama',2013,7.7,'https://image.tmdb.org/t/p/w500/dOEUfQDRhIMwBlSHaJArOE6AL8l.jpg');
